CREATE TABLE `dependent` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(191) COLLATE utf8mb4_unicode_ci NOT NULL,
  `birth_date` date NOT NULL,
  `cpf` varchar(191) COLLATE utf8mb4_unicode_ci NOT NULL,
  `rg` varchar(191) COLLATE utf8mb4_unicode_ci NOT NULL,
  `email` varchar(191) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `cns` varchar(191) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `parentesco` varchar(191) COLLATE utf8mb4_unicode_ci NOT NULL,
  `nome_mae` varchar(191) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `nome_pai` varchar(191) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `plan_id` int(10) unsigned NOT NULL,
  `subscriber_id` int(10) unsigned NOT NULL,
  `carteirinha` varchar(25) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `naturalidade` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `dependent_cpf_unique` (`cpf`),
  KEY `dependent_subscriber_id_foreign` (`subscriber_id`),
  KEY `dependent_plan_id_foreign` (`plan_id`),
  CONSTRAINT `dependent_plan_id_foreign` FOREIGN KEY (`plan_id`) REFERENCES `plans` (`id`),
  CONSTRAINT `dependent_subscriber_id_foreign` FOREIGN KEY (`subscriber_id`) REFERENCES `subscribers` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2041 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;
