INSERT INTO `plans` VALUES (1,'Plano (A)','Monthly',4990,1000,1,1,1,'2019-01-30 17:10:37','2021-05-04 16:54:14','426.610/99-2','<p><strong>URGÊNCIA/EMERGÊNCIA</strong></p><p> Colagem de Fragmentos Dentários</p><p> Controle de Hemorragia com ou sem Aplicação de Agente Hemostático</p><p> Incisão e Drenagem (Intra ou Extra-Oral) de Abscesso, Hematoma ou Flegmão da Região Buco-Maxilo-</p><p><strong><br></strong></p><p><strong>Facial</strong></p><p> Imobilização Dentária</p><p> Recimentação de Peça/Trabalho Protético</p><p> Redução de Luxação da Atm</p><p> Reimplante de Dente Avulsionado com Contenção</p><p> Sutura de Ferida Buco-Maxilo-Facial</p><p> Tratamento de Abscesso Periodontal</p><p> Tratamento de Alveolite</p><p> Tratamento de Odontalgia Aguda</p><p>DIAGNÓSTICO</p><p> Consulta Odontológica Inicial</p><p>CONDICIONAMENTO</p><p> Condicionamento em Odontologia</p><p><br></p><p><strong>EXAMES</strong></p><p> Procedimento Diagnóstico Anatomopatológico (em Peça Cirúrgica, Material de Punção/Biópsia e Citologia</p><p>Esfoliativa da Região Bucomaxilo-Facial)</p><p> Teste de Fluxo Salivar</p><p><br></p><p><strong>RADIOLOGIA</strong></p><p> Radiografia Interproximal (Bite-Wing)</p><p> Radiografia Oclusal</p><p> Radiografia Periapical</p><p>PREVENÇÃO EM SAÚDE BUCAL</p><p> Aplicação de Selante</p><p> Aplicação Tópica de Flúor</p><p> Atividade Educativa em Saúde Bucal</p><p> Controle de Biofilme Dental (Placa Bacteriana)</p><p> Dessensibilização Dentária</p><p> Profilaxia - Polimento Coronário</p><p> Remineralização Dentária</p><p><strong>DENTÍSTICA</strong></p><p> Adequação do Meio Bucal</p><p> Ajuste Oclusal</p><p> Aplicação de Cariostático</p><p> Faceta Direta em Resina Fotopolimerizável</p><p> Núcleo de Preenchimento</p><p> Remoção de Fatores de Retenção de Biofilme Dental (Placa Bacteriana)</p><p> Restauração em Amálgama</p><p> Restauração em Ionômero de Vidro</p><p> Restauração em Resina Fotopolimerizável</p><p> Restauração Temporária /Tratamento Expectante</p><p> Tratamento Restaurador Atraumático</p><p><strong>PERIODONTIA</strong></p><p> Aumento de Coroa Clínica</p><p> Cirurgia Periodontal a Retalho</p><p> Cunha Proximal</p><p> Gengivectomia/Gengivoplastia</p><p> Raspagem Sub-Gengival e Alisamento Radicular/Curetagem de Bolsa Periodontal</p><p> Raspagem Supra-Gengival e Polimento Coronário</p><p> Enxerto Pediculado</p><p> Enxerto gengival</p><p> Tunelização</p><p><br></p><p><strong>ENDODONTIA</strong></p><p> Capeamento Pulpar Direto – Excluindo Restauração Final</p><p> Pulpotomia</p><p> Remoção de Corpo Estranho Intra-Canal</p><p> Remoção de Núcleo Intra-Canal</p><p> Remoção de Peça/Trabalho Protético</p><p> Tratamento de Perfuração (Radicular/Câmara Pulpar)</p><p> Tratamento Endodôntico em Dente com Rizogênese Incompleta</p><p> Tratamento Endodôntico em Dentes Decíduos</p><p> Tratamento Endodôntico em Dentes Permanentes</p><p> Retratamento Endodôntico em Dentes Permanentes</p><p><br></p><p><strong>CIRURGIA</strong></p><p> Alveoloplastia</p><p> Amputação Radicular com ou sem Obturação Retrógrada</p><p> Apicetomia com ou sem Obturação Retrógrada</p><p> Aprofundamento/Aumento de Vestíbulo</p><p> Biópsia de Boca</p><p> Biópsia de Glândula Salivar</p><p> Biópsia de Lábio</p><p> Biópsia de Língua</p><p> Biópsia de Mandíbula/Maxila</p><p> Bridectomia/Bridotomia</p><p> Cirurgia para Tórus/Exostose</p><p> Exérese de Pequenos Cistos de Mandíbula/Maxila</p><p> Exérese ou Excisão de Mucocele, Rânula ou Cálculo Salivar</p><p> Exodontia a Retalho</p><p> Exodontia de Raiz Residual</p><p> Exodontia Simples de Decíduo</p><p> Exodontia Simples de Permanente</p><p> Frenotomia/Frenectomia Labial</p><p> Frenotomia/Frenectomia Lingual</p><p> Odonto-Secção</p><p> Punção Aspirativa com Agulha Fina/Coleta de Raspado em Lesões ou Sítios Específicos da Região Buco-</p><p>Maxilo-Facial</p><p> Redução de Fratura Alvéolo Dentária</p><p> Remoção de Dentes Retidos (Inclusos, Semi-Inclusos ou Impactados)</p><p> Tratamento Cirúrgico de Fístulas Buco-Nasais ou Buco-Sinusais</p><p> Tratamento Cirúrgico de Tumores Benignos e Hiperplasias de Tecidos Moles da Região Buco-Maxilo-Facial</p><p> Tratamento Cirúrgico de Tumores Benignos e Hiperplasias de Tecidos Ósseos/Cartilaginosos na</p><p>Mandíbula/Maxila</p><p> Tratamento Cirúrgico de Tumores Benignos Odontogênicos sem Reconstrução</p><p> Ulectomia/Ulotomia</p><p><br></p><p><strong>PRÓTESE</strong></p><p> Coroa Unitária Provisória com ou sem Pino/Provisório para Preparo de RMF</p><p> Reabilitação com Coroa de Acetato, Aço ou Policarbonato</p><p> Reabilitação com Coroa Total de Cerômero Unitária - Inclui a Peça Protética</p><p> Reabilitação com Coroa Total Metálica Unitária - Inclui a Peça Protética</p><p> Reabilitação com Núcleo Metálico fundido/Núcleo Pré-Fabricado - Inclui a Peça Protética</p><p> Reabilitação com Restauração Metálica Fundida (RMF) Unitária - Inclui a Peça Protética</p>',1,'https://s3.us-east-1.amazonaws.com/arquivoscomprodonto/fotos_planos/1581514350_pplanouniodontopoosdecaldasp','<p>Planos aprovados pela ANS com <strong><em><u>carência ZERO*!</u></em></strong> É contratar e <strong>usar no dia seguinte</strong>.</p><p><br></p><ul><li><strong><u>Ocorrendo a rescisão antes do término do prazo inicial de vigência, o CONTRATANTE se sujeitará ao pagamento multa pecuniária equivalente a 20 % (vinte por cento) do valor das mensalidades que seriam devidas até o término do citado prazo.</u></strong></li></ul><p><br></p><p><span style=\"color: rgb(0, 0, 0);\">Principais Coberturas</span></p><p><br></p><p><span style=\"color: rgb(0, 0, 0);\">•	Extrações de dentes (inclusive sisos).</span></p><p><span style=\"color: rgb(0, 0, 0);\">•	Tratamento de canal.</span></p><p><span style=\"color: rgb(0, 0, 0);\">•	Prótese simples (unitária).</span></p><p><span style=\"color: rgb(0, 0, 0);\">•	Urgência e Emergência (curativos, reparos e alívio da dor).</span></p><p>•	Diagnóstico (consulta e exames).</p><p>•	Radiologia (radiografias odontológicas, inclusive panorâmicas).</p><p>•	Prevenção (orientação, polimentos e aplicação de flúor e/ou selantes).</p><p>•	Orientação de higiene bucal.</p><p>•	Tratamento de gengiva.</p><p>•	Cirurgia.</p><p>•	Consultas com especialistas em odontopediatria.</p><p>•	Limpezas periódicas.</p><p>•	Restaurações.</p><p><br></p><p>*Carência zero para plano anual com pagamento no cartão de crédito.</p>',0,1,0,'<ul><li class=\"ql-align-justify\"><strong style=\"background-color: transparent;\">Posso adicionar participantes ao meu plano?</strong></li></ul><p><br></p><p class=\"ql-align-justify\"><span style=\"background-color: transparent;\">Nossos planos são vendidos individualmente, portanto, você deve adicionar a mesma quantidade de plano com a quantidade de participantes que irão utilizar os planos. Sendo que um dos participantes será o responsável financeiro. Após contratar o plano </span><strong style=\"background-color: transparent;\">não é permitida </strong><span style=\"background-color: transparent;\">a inclusão de novos participantes.</span></p><p><br></p><ul><li class=\"ql-align-justify\"><strong style=\"background-color: transparent;\">Qual a forma de pagamento?</strong></li></ul><p class=\"ql-align-justify\"><span style=\"background-color: transparent;\">A opção de pagamento está habilitada para cartão de crédito. </span>Temos a vantagem de não consumir seu limite total do cartão. Descontamos apenas o valor referente a mensalidade do plano contratado, pois o modelo de cobrança é em forma de recorrência, cobrando assim o valor contratado mensalmente no dia que foi feito o primeiro pagamento. Por exemplo: Se você contratar o plano no dia 16 de Fevereiro, será cobrado nos meses subsequentes, no dia 16, o valor contratado.</p><p><br></p><ul><li class=\"ql-align-justify\"><strong style=\"background-color: transparent;\">Qual idade atende o plano Kids?</strong></li></ul><p class=\"ql-align-justify\"><span style=\"background-color: transparent;\">O plano Kids atende crianças de 0 a 17 anos.&nbsp;</span></p><p><br></p><ul><li class=\"ql-align-justify\"><strong style=\"background-color: transparent;\">Eu recebo a carteirinha em casa?</strong></li></ul><p class=\"ql-align-justify\"><span style=\"background-color: transparent;\">Sim, em média 20 dias após a contratação de seu plano, você receberá sua carteirinha física no CEP informado.&nbsp;</span></p><p><br></p><ul><li class=\"ql-align-justify\"><strong style=\"background-color: transparent;\">Temos um plano familiar?&nbsp;</strong></li></ul><p class=\"ql-align-justify\"><span style=\"background-color: transparent;\">Não, nossos planos são individuais. </span></p><p class=\"ql-align-justify\"><br></p><ul><li class=\"ql-align-justify\"><strong>No caso de cancelamento há alguma multa?</strong></li></ul><p>Ocorrendo a rescisão antes do término do prazo inicial de vigência, o CONTRATANTE se sujeitará ao pagamento multa pecuniária equivalente a 20 % (vinte por cento) do valor das mensalidades que seriam devidas até o término do citado prazo.</p><p class=\"ql-align-justify\"><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p class=\"ql-align-justify\"><br></p><p><br></p><p class=\"ql-align-justify\"><br></p>'),(4,'Plano Essencial 12 meses','Monthly',6780,0,1,1,10,'2019-02-05 15:20:47','2021-04-14 20:47:28','482486195','<p><strong>Ideal para quem quer realizar desde os procedimentos mais simples até os mais complexos, o Plano Essencial é completo e possui um ótimo custo-benefício.</strong></p><p class=\"ql-align-justify\"><strong>Ele cobre tratamentos em&nbsp;todas as áreas odontológicas.</strong></p><p class=\"ql-align-justify\"><strong style=\"color: inherit;\">E o melhor: sem nenhuma carência.</strong></p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\"><strong style=\"color: rgb(38, 38, 38);\">COBERTURA DO PLANO ESSENCIAL (PESSOA FÍSICA)</strong></p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\"><