oa admitida no plano odontológico da Uniodonto de São José dos Campos para contratação do plano Essencial (pessoa física).</p>',0,0,7535,'<ul><li class=\"ql-align-justify\"><strong style=\"background-color: transparent;\">Posso adicionar participantes ao meu plano?</strong></li></ul><p><br></p><p class=\"ql-align-justify\"><span style=\"background-color: transparent;\">Nossos planos são vendidos individualmente, portanto, você deve adicionar a mesma quantidade de plano com a quantidade de participantes que irão utilizar os planos. Sendo que um dos participantes será o responsável financeiro. Após contratar o plano </span><strong style=\"background-color: transparent;\">não é permitida </strong><span style=\"background-color: transparent;\">a inclusão de novos participantes.</span></p><p><br></p><ul><li class=\"ql-align-justify\"><strong style=\"background-color: transparent;\">Qual a forma de pagamento?</strong></li></ul><p class=\"ql-align-justify\"><span style=\"background-color: transparent;\">A opção de pagamento está habilitada para cartão de crédito. </span>Temos a vantagem de não consumir seu limite total do cartão. Descontamos apenas o valor referente a mensalidade do plano contratado, pois o modelo de cobrança é em forma de recorrência, cobrando assim o valor contratado mensalmente no dia que foi feito o primeiro pagamento. Por exemplo: Se você contratar o plano no dia 16 de Fevereiro, será cobrado nos meses subsequentes, no dia 16, o valor contratado.</p><p><br></p><ul><li class=\"ql-align-justify\"><strong style=\"background-color: transparent;\">Qual idade atende o plano Kids?</strong></li></ul><p class=\"ql-align-justify\"><span style=\"background-color: transparent;\">O plano Kids atende crianças de 0 a 17 anos.&nbsp;</span></p><p><br></p><ul><li class=\"ql-align-justify\"><strong style=\"background-color: transparent;\">Qual a diferença dos planos 12, 24 e 36 meses ?</strong></li></ul><p><br></p><p class=\"ql-align-justify\"><span style=\"color: rgb(36, 41, 46);\">O Plano Essencial é para quem busca uma cobertura mais ampla, com procedimentos complexos e específicos: cobre cirurgias, próteses (coroas metálicas), obturações, extrações de dentes (sisos), tratamento de canal, radiografias, biópsia entre outros. 12,24 e 36 meses, é a vigência de cada plano contratado.&nbsp;</span></p><ul><li class=\"ql-align-justify\"><strong>Qual a diferença entre um plano e o outro? ( Plano Classic e Plano Essencial)</strong></li></ul><p class=\"ql-align-justify\"><span style=\"color: rgb(36, 41, 46);\">O Plano Classic oferece atendimento de urgência e emergência 24 horas com tratamentos, restaurações, limpeza, cuidados e reparos diários.&nbsp;</span></p><p class=\"ql-align-justify\"><span style=\"color: rgb(36, 41, 46);\">O Plano Essencial é para quem busca uma cobertura mais ampla, com procedimentos complexos e específicos: cobre cirurgias, próteses (coroas metálicas), obturações, extrações de dentes (sisos), tratamento de canal, radiografias, biópsia entre outros.</span></p><p><br></p><ul><li class=\"ql-align-justify\"><strong style=\"background-color: transparent;\">Eu recebo a carteirinha em casa?</strong></li></ul><p class=\"ql-align-justify\"><span style=\"background-color: transparent;\">Sim, em média 20 dias após a contratação de seu plano, você receberá sua carteirinha física no CEP informado.&nbsp;</span></p><p><br></p><ul><li class=\"ql-align-justify\"><strong style=\"background-color: transparent;\">Temos um plano familiar?&nbsp;</strong></li></ul><p class=\"ql-align-justify\"><span style=\"background-color: transparent;\">Não, nossos planos são individuais.&nbsp;</span></p><p><br></p>'),(10,'Plano Essencial 24 meses','Monthly',5420,0,1,1,10,'2019-08-23 21:27:37','2021-04-14 20:46:22','482486195','<p><strong>Ideal para quem quer realizar desde os procedimentos mais simples até os mais complexos, o Plano Essencial é completo e possui um ótimo custo-benefício.</strong></p><p class=\"ql-align-justify\"><strong>Ele cobre 