litada para cartão de crédito. </span>Temos a vantagem de não consumir seu limite total do cartão. Descontamos apenas o valor referente a mensalidade do plano contratado, pois o modelo de cobrança é em forma de recorrência, cobrando assim o valor contratado mensalmente no dia que foi feito o primeiro pagamento. Por exemplo: Se você contratar o plano no dia 16 de Fevereiro, será cobrado nos meses subsequentes, no dia 16, o valor contratado.</p><p><br></p><ul><li class=\"ql-align-justify\"><strong style=\"background-color: transparent;\">Qual idade atende o plano Kids?</strong></li></ul><p class=\"ql-align-justify\"><span style=\"background-color: transparent;\">O plano Kids atende crianças de 0 a 17 anos.&nbsp;</span></p><p><br></p><ul><li class=\"ql-align-justify\"><strong style=\"background-color: transparent;\">Qual a diferença de dos planos 12, 24 e 36 meses ?</strong></li></ul><p><br></p><p class=\"ql-align-justify\"><span style=\"color: rgb(36, 41, 46);\">O Plano Essencial é para quem busca uma cobertura mais ampla, com procedimentos complexos e específicos: cobre cirurgias, próteses (coroas metálicas), obturações, extrações de dentes (sisos), tratamento de canal, radiografias, biópsia entre outros. 12,24 e 36 meses, é a vigência de cada plano contratado.&nbsp;</span></p><ul><li class=\"ql-align-justify\"><strong>Qual a diferença entre um plano e o outro? ( Plano Classic e Plano Essencial )</strong></li></ul><p class=\"ql-align-justify\"><span style=\"color: rgb(36, 41, 46);\">O Plano Classic oferece atendimento de urgência e emergência 24 horas com tratamentos, restaurações, limpeza, cuidados e reparos diários.&nbsp;</span></p><p class=\"ql-align-justify\"><span style=\"color: rgb(36, 41, 46);\">O Plano Essencial é para quem busca uma cobertura mais ampla, com procedimentos complexos e específicos: cobre cirurgias, próteses (coroas metálicas), obturações, extrações de dentes (sisos), tratamento de canal, radiografias, biópsia entre outros.</span></p><p><br></p