><ul><li class=\"ql-align-justify\"><strong style=\"background-color: transparent;\">Qual a forma de pagamento?</strong></li></ul><p class=\"ql-align-justify\"><span style=\"background-color: transparent;\">A opção de pagamento está habilitada para cartão de crédito. </span>Temos a vantagem de não consumir seu limite total do cartão. Descontamos apenas o valor referente a mensalidade do plano contratado, pois o modelo de cobrança é em forma de recorrência, cobrando assim o valor contratado mensalmente no dia que foi feito o primeiro pagamento. Por exemplo: Se você contratar o plano no dia 16 de Fevereiro, será cobrado nos meses subsequentes, no dia 16, o valor contratado.</p><p><br></p><ul><li class=\"ql-align-justify\"><strong style=\"background-color: transparent;\">Qual idade atende o plano Kids?</strong></li></ul><p class=\"ql-align-justify\"><span style=\"background-color: transparent;\">O plano Kids atende crianças de 0 a 17 anos.&nbsp;</span></p><p><br></p><ul><li class=\"ql-align-justify\"><strong style=\"background-color: transparent;\">Qual a diferença de dos planos 12, 24 e 36 meses ?</strong></li></ul><p><br></p><p class=\"ql-align-justify\"><span style=\"color: rgb(36, 41, 46);\">O Plano Essencial é para quem busca uma cobertura mais ampla, com procedimentos complexos e específicos: cobre cirurgias, próteses (coroas metálicas), obturações, extrações de dentes (sisos), tratamento de canal, radiografias, biópsia entre outros. 12,24 e 36 meses, é a vigência de cada plano contratado.&nbsp;</span></p><ul><li class=\"ql-align-justify\"><strong>Qual a diferença entre um plano e o outro? ( Plano Classic e Plano Essencial )</strong></li></ul><p class=\"ql-align-justify\"><span style=\"color: rgb(36, 41, 46);\">O Plano Classic oferece atendimento de urgência e emergência 24 horas com tratamentos, restaurações, limpeza, cuidados e reparos diários.&nbsp;</span></p><p class=\"ql-align-justify\"><span style=\"color: rgb(36, 41, 46);\">O Plano Essencial é para quem busca uma cobertura mais ampla, com procedimentos complexos e específicos: cobre cirurgias, próteses (coroas metálicas), obturações, extrações de dentes (sisos), tratamento de canal, radiografias, biópsia entre outros.</span></p><p><br></p><ul><li class=\"ql-align-justify\"><strong style=\"background-color: transparent;\">Eu recebo a carteirinha em casa?</strong></li></ul><p class=\"ql-align-justify\"><span style=\"background-color: transparent;\">Sim, em média 20 dias após a contratação de seu plano, você receberá sua carteirinha física no CEP informado.&nbsp;</span></p><ul><li class=\"ql-align-justify\"><strong style=\"background-color: transparent;\">Tem plano familiar?&nbsp;</strong></li></ul><p class=\"ql-align-justify\"><span style=\"background-color: transparent;\">Não, nossos planos são individuais. </span></p><p><br></p><p><br></p>'),(27,'Plano kids 36 meses','Monthly',2699,0,1,0,11,'2020-03-25 00:00:00','2021-03-16 18:23:03','433.162/00-1','<p class=\"ql-align-justify\">COBERTURA DO PLANO KIDS</p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\">CONSULTA E PROCEDIMENTOS DE URGÊNCIA&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p><p>·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Consulta odontológica inicial</p><p>·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Consulta odontológica</p><p>·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Consulta odontológica para avaliação técnica de auditoria</p><p>·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Consulta odontológica de urgência - 8h às 20h</p><p>·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Consulta odontológica de urgência 24 hs - 20h às 8h</p><p>·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Urgência consulta incluída - 8h às 20h exclusivo para plantonistas</p><p>·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Urgência consulta incluída - 20h às 8h exclusivo para plantonistas</p><p>·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Controle de hemorragia com aplicação de agente hemo