ia 20 dias após a contratação de seu plano, você receberá sua carteirinha física no CEP informado.&nbsp;</span></p><ul><li class=\"ql-align-justify\"><strong style=\"background-color: transparent;\">Tem plano familiar?&nbsp;</strong></li></ul><p class=\"ql-align-justify\"><span style=\"background-color: transparent;\">Não, nossos planos são individuais. </span></p><p><br></p><p><br></p>'),(28,'Plano Orto Vip','Monthly',6000,1500,1,1,12,'2020-03-25 00:00:00','2021-03-16 18:28:07','470.595/14-5','<p><strong><em>Plano Orto Vip Pessoa Física&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Nº reg. Produto: 470.595/14-5</em></strong></p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\"><strong>A cobertura deste plano se refere aos serviços exclusivamente odontológicos conforme rol editado pela Agência Nacional de Saúde Suplementar, e suas atualizações. </strong></p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\"><strong>URGÊNCIA/EMERGÊNCIA</strong></p><ul><li>Colagem de Fragmentos Dentários</li><li>Controle de Hemorragia com ou sem Aplicação de Agente Hemostático</li><li>Incisão e Drenagem (Intra ou Extra-Oral) de Abscesso, Hematoma ou Flegmão da Região Buco-Maxilo-Facial</li><li>Imobilização Dentária</li><li>Recimentação de Peça/Trabalho Protético</li><li>Redução de Luxação da Atm</li><li>Reimplante de Dente Avulsionado com Contenção</li><li>Sutura de Ferida Buco-Maxilo-Facial&nbsp;</li><li>Tratamento de Abscesso Periodontal</li><li>Tratamento de Alveolite</li><li>Tratamento de Odontalgia Aguda</li></ul><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\"><strong>DIAGNÓSTICO</strong></p><ul><li>Consulta Odontológica Inicial</li></ul><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\"><strong>CONDICIONAMENTO</strong></p><ul><li>Condicionamento em Odontologia</li></ul><p class=\"ql-align-justify\">&nbsp;</p><p class=\"ql-align-justify\"><strong>EXAMES</strong></p><ul><li class=\"ql-