"background-color: transparent;\">Nossos planos são vendidos individualmente, portanto, você deve adicionar a mesma quantidade de plano com a quantidade de participantes que irão utilizar os planos. Sendo que um dos participantes será o responsável financeiro. Após contratar o plano não é permitida a inclusão de novos participantes.</span></p><p class=\"ql-align-justify\">&nbsp;</p><ul><li class=\"ql-align-justify\"><strong style=\"background-color: transparent; color: rgb(119, 119, 119);\">Qual a forma de pagamento?</strong></li></ul><p class=\"ql-align-justify\"><span style=\"background-color: transparent;\">A opção de pagamento está habilitada para cartão de crédito. Temos a vantagem de não consumir seu limite total do cartão. Descontamos apenas o valor referente a mensalidade do plano contratado, pois o modelo de cobrança é em forma de recorrência, cobrando assim o valor contratado mensalmente no dia que foi feito o primeiro pagamento. Por exemplo: Se você contratar o plano no dia 16 de Fevereiro, será cobrado nos meses subsequentes, no dia 16, o valor contratado.</span></p><p class=\"ql-align-justify\">&nbsp;</p><ul><li class=\"ql-align-justify\"><strong style=\"background-color: transparent; color: rgb(119, 119, 119);\">Temos um plano familiar?&nbsp;</strong></li></ul><p class=\"ql-align-justify\"><span style=\"background-color: transparent;\">Não, nossos planos são individuais.</span></p><p><br></p><p><br></p>'),(36,'Plano Plus','Monthly',4790,500,1,1,16,'2020-03-25 00:00:00','2021-05-14 13:22:36','32.744-1','<p>&nbsp;PROCEDIMENTOS DE URGÊNCIA/EMERGÊNCIA (CARÊNCIA 24H)</p><p><br></p><p>Curativo em caso de hemorragia bucal</p><p>Curativo em caso de odontologia aguda	</p><p>Imobilização dentária temporária ou permanente</p><p>Recimentação de peça protética</p><p>Tratamento de alveolite</p><p>Reimplante de dente avulsionado (por elemento) – incluída a contenção</p><p>Incisão e drenagem de abscesso (intra-oral e extra-oral)</p><p>Colagem de fragmento</p><p>Reduçã