l</p><p>Ajuste oclusal</p><p>Gengivectomia/Gengivoplastia</p><p>Sepultamento radicular</p><p>Aumento de coroa clínica</p><p>Cunha distal</p><p>Cirurgia periodontal a retalho</p><p><br></p><p>ENDODONTIA:</p><p>Pulpotomia</p><p>Remoção de núcleo intrarradicular/corpo estranho</p><p>Tratamento endodôntico em dentes permanentes com 01 (um) conduto</p><p>Tratamento endodôntico em dentes permanentes com 02 (dois) condutos</p><p>Tratamento endodôntico em dentes permanentes com 03 (três) condutos</p><p>Tratamento endodôntico em dentes permanentes com 04 (quatro) condutos ou mais</p><p>Retratamento endodôntico de dentes incisivos, caninos, pré-molares e molares</p><p>Tratamento endodôntico em dentes decíduos</p><p>Tratamento endodôntico em dente com rizogênese incompleta</p><p>Tratamento de perfuração radicular</p><p><br></p><p>CARÊNCIA 180 DIAS</p><p><br></p><p>RADIOLOGIA</p><p>Panorâmica da mandíbula/maxila*7</p><p><br></p><p>PREVENÇÃO EM SAÚDE BUCAL</p><p>Teste de fluxo salivar</p><p><br></p><p>ODONTOPEDIATRIA</p><p>Reabilitação com coroa de acetato/aço ou policarbonato*8</p><p><br></p><p>CIRURGIA:</p><p>Alveoloplastia</p><p>Apicectomia unirradicular</p><p>Apicectomia birradicular</p><p>Apicectomia trirradicular</p><p>Apicectomia unirradicular com obturação retrógrada</p><p>Apicectomia birradicular com obturação retrógrada</p><p>Apicectomia trirradicular com obturação retrógrada</p><p>Biópsia*9</p><p>Cirurgia de tórus mandibular unilateral</p><p>Cirurgia de tórus mandibular bilateral</p><p>Cirurgia de tórus palatino</p><p>Correção de bridas musculares</p><p>Excisão de mucocele</p><p>Excisão de rânula</p><p>Exodontia a retalho</p><p>Fratura alvéolo dentária (redução cruenta/incruenta)</p><p>Frenectomia labial</p><p>Frenectomia lingual</p><p>Remoção de dentes retidos (inclusos ou impactados)</p><p>Sulcoplastia;</p><p>Hemissecção com ou sem amputação radicular.</p><p>Exerese&nbsp;de cistos de mandíbula/maxila</p><p>Punção aspirativa</p><p>Tratamento cirúrgico de fístulas buco-nasais ou buco-sinusais*10</p><p>Tratamento cirúrgico de tumores benignos e hiperplasias de tecidos moles na mandíbula/maxila*11</p><p>Tratamento cirúrgico de tumores benignos e hiperplasias de tecidos ósseos/cartilaginosos na mandíbula/maxila*12</p><p>Tratamento cirúrgico de tumores benignos odontogênicos sem reconstrução*13</p><p><br></p><p>PRÓTESE</p><p>Coroa unitária provisória (preparo de RMF)*14</p><p>Coroa total de cerômero (dentes anteriores)*15</p><p>Coroa total metálica*16</p><p>Núcleo metálico fundido*17</p><p>Restauração metálica fundida (RMF)*18</p><p>&nbsp;&nbsp;&nbsp;&nbsp;</p><p>1.REDUÇAO DE LUXAÇÃO DA ATM</p><p>Cobertura obrigatória na segmentação odontológica quando o procedimento for passível de realização em ambiente ambulatorial, conforme indicação do cirurgião – dentista assistente.</p><p>2. APLICAÇÃO DE SELANTE</p><p>Cobertura obrigatória quando preenchido pelo menos um dos seguintes critérios, conforme indicação do cirurgião – dentista assistente:</p><p>a.	Procedimento restaurador minimamente invasivo em dentes decíduos e permanentes;</p><p>b.	Procedimento preventivo em fóssulas e fissuras de dentes decíduos e permanentes.</p><p>3. CONTROLE OU EVIDENCIAÇÃO DE PLACA BACTERIANA / TECNICA DE ESCOVAÇÃO</p><p>Até 14 anos de idade</p><p>4. CONDICIONAMENTO EM ODONTOLOGIA</p><p>Cobertura mínima obrigatória de 3 (três) sessões/ ano para beneficiários com comportamento não cooperativo/de difícil manejo, conforme indicação do cirurgião – dentista assistente.</p><p>5. APLICAÇÃO DE CARIOSTÁTICO&nbsp;</p><p>Cobertura obrigatória como tratamento provisório em dentes decíduos, visando interromper a atividade da cárie, devendo ser seguido de um tratamento restaurador e associado a ações de promoção da saúde e prevenção de doenças, conforme indicação do cirurgião-dentista assistente.</p><p>6. ADEQUAÇÃO DO MEIO BUCAL</p><p>Cobertura obrigatória como tratamento preliminar ao tratamento restaurador, conforme indicação do cirurgião – dentista assistente.</p><p>7. PANORÂMICA DE MANDÍBULA/MAXILA</p><p>&nbsp;&nbsp;&nbsp;(ORTOPANTOMOGRAFIA)</p><p>Cobertura obrigatória na segmentação odontológica como auxílio diagnóstico; pré e/ou pós procedimento cirúrgico odontológico.</p><p>8. REABILITAÇÃO COM COROA DE ACETATO/AÇO&nbsp;OU POLICARBONATO</p><p>Cobertura obrigatória quando preenchido pelo menos um dos seguintes critérios, conforme indicação do cirurgião – dentista assistente:</p><p>a)	Dentes decíduos não passíveis de reconstrução por meio direto;</p><p>b)	Dentes permanentes em pacientes não cooperativos/de difícil manejo.</p><p>9. BIÓPSIA DE BOCA</p><p>Para a segmentação odontológica, a cobertura será obrigatória quando a extensão, localização e características da lesão permitirem a realização do procedimento em ambiente ambulatorial, conforme indicação do cirurgião – dentista assistente.</p><p>•	BIÓPSIA DE GLANDULA SALIVAR</p><p>Para a segmentação odontológica, a cobertura será obrigatória quando a extensão, localização e características da lesão permitirem a realização do procedimento em ambiente ambulatorial, conforme indicação do cirurgião – dentista assistente.</p><p>•	BIÓPSIA DE LÍNGUA&nbsp;</p><p>Para a segmentação odontológica, a cobertura será obrigatória quando a extensão e características da lesão permitirem a realização do procedimento em ambiente ambulatorial, conforme indicação do cirurgião – dentista assistente.</p><p>•	BIÓPSIA DE MANDÍBULA / MAXILA&nbsp;</p><p>Para a segmentação odontológica, a cobertura será obrigatória quando a extensão, localização e característica da lesão permitirem a realização do procedimento em ambiente ambulatorial, conforme indicação do cirurgião – dentista assistente.</p><p>10. TRATAMENTO CIRÚRGICO DE FÍSTULA BUCO-NASAL&nbsp;OU BUCO-SINUSAIS</p><p>Para a segmentação odontológica, a cobertura será obrigatória quando a extensão, localização e característica da lesão permitirem a realização do procedimento em ambiente ambulatorial, conforme indicação do cirurgião – dentista assistente.</p><p>11. TRATAMENTO CIRÚRGICO DE TUMORES BENIGNOS E HIPERPLASIAS DE TECIDOS MOLES DA REGIÃO BUCO- MAXILO-FACIAL</p><p>Para segmentação odontológica, a cobertura será obrigatória quando a extensão, localização e características da lesão permitirem a realização do procedimento em ambiente ambulatorial, conforme a indicação do cirurgião-dentista assistente.</p><p>12. TRATAMENTO CIRÚRGICO DE TUMORES BENIGNOS E HIPERPLASIAS DE TECIDO ÓSSEOS/ CARTILOGINOSOS NA MANDÍBULA/ MAXILA</p><p>Para a segmentação odontológica, a cobertura será obrigatória quando a extensão, localização e característica da lesão permitirem a realização do procedimento em ambiente ambulatorial, conforme indicação do cirurgião – dentista assistente.</p><p>13. TRATAMENTO CIRÚRGICO DE TUMORES BENIGNOS ODONTOGENICOS SEM RECONSTRUÇÃO</p><p>Para a segmentação odontológica, a cobertura será obrigatória quando a extensão, localização e características da lesão permitirem a realização do procedimento em ambiente ambulatorial, conforme indicação do cirurgião – dentista assistente.</p><p>14. COROA UNITÁRIA PROVISÓRIA COM&nbsp;OU SEM PINO/ PROVISÓRIO PARA PREPARO DE RESTAURAÇÃO METÁLICA FUNDIDA (RMF)</p><p>Cobertura obrigatória como procedimento de caráter provisório, em dentes permanentes não passiveis de reconstrução por meio direto, conforme indicação do cirurgião – dentista assistente.</p><p>15. REABILITAÇÃO COM COROA TOTAL DE CEROMERO UNITÁRIA - INCLUI A PEÇA PROTÉTICA</p><p>Cobertura obrigatória em dentes permanentes anteriores (incisivos e caninos) não passíveis de reconstrução por meio direto, conforme indicação do cirurgião – dentista assistente.</p><p>16. REABILITAÇÃO COM COROA TOTAL METÁLICA UNITÁRIA – INCLUI A PEÇA PROTÉTICA&nbsp;</p><p>Cobertura obrigatória em dentes permanentes posteriores (pré-molares e molares) não passíveis de reconstrução por meio direto nem Restauração Metálica Fundida, conforme indicação do cirurgião – dentista assistente.</p><p>17. REABILITAÇÃO COM NÚCLEO METÁLICO FUNDIDO/NÚCLEO PRÉ –FABRICADO - INCLUI A PEÇA PROTÉTICA</p><p>Cobertura obrigatória em dentes permanentes com tratamento endodôntico prévio, conforme indicação do cirurgião-dentista assistente.</p><p>18. REABILITAÇÃO COM RESTAURAÇÃO METÁLICA FUNDIDA (RMF) UNITÁRIA – INCLUI A PEÇA PROTÉTICA</p><p>Cobertura obrigatória em dentes permanentes posteriores quando preenchido pelo menos um dos seguintes critérios, conforme indicação do cirurgião-dentista assistente:</p><p>a)	Dentes com comprometimento de 3 (três) ou mais faces, não passiveis de reconstrução por meio direto;</p><p>b)	Dentes com comprometimento de cúspide funcional, independente do número de faces afetadas.</p><p><br></p><p><br></p><p>ATOS NÃO COBERTOS PELO ROL  ANS</p><p>PROCEDIMENTOS DE IMPLANTODONTIA;</p><p>PROCEDIMENTOS DE CLAREAMENTO;</p><p>PROCEDIMENTOS DE ÓRTESE E PRÓTESE;</p><p>PROCEDIMENTOS DE ESTÉTICA;</p><p>PROCEDIMENTOS ORTODÔNTICOS;</p><p>TOMOGRAFIA;</p><p>REVISÃO COM ULTRASSOM.</p><p><br></p><p>&nbsp;&nbsp;ATOS NÃO COBERTOS:</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Serão cobrados pela tabela própria da UNIODONTO Juiz de Fora.&nbsp;&nbsp;&nbsp;&nbsp;</p><p><br></p>',1,'https://s3.us-east-1.amazonaws.com/arquivoscomprodonto/fotos_planos/1620998556_planoplus','<p class=\"ql-align-justify\">Ideal para quem quer realizar desde os procedimentos mais simples até os mais complexos, o Plano Plus é bem completo e possui um ótimo custo-benefício. </p><p class=\"ql-align-justify\">Como a máxima “a saúde começa pela boca”, o plano Plus garante a cobertura de mais de 150 atos relacionados aos procedimentos que qualquer possa pessoa possa vir a precisar, dentre eles tratamento de canal, de gengiva, obturações, extrações de sisos, radiografias, procedimentos preventivos e muito mais.</p><p class=\"ql-align-justify\">Ele cobre tratamentos em todas as áreas odontológicas e contempla todo Rol de Procedimentos da ANS (Agência Nacional de Saúde Suplementar).</p><p class=\"ql-align-justify\">Vantagens como segurança, comodidade e confiabilidade também devem ser levadas em conta na hora de escolher o plano. Estará a sua disposição consultas periódicas com profissionais competentes, sem gastar muito. Porque torna-se primordial investir na saúde pessoal.</p><p><br></p><p><br></p>',90,1,0,'<ul><li class=\"ql-align-justify\"><strong style=\"background-color: transparent;\">Posso adicionar participantes ao meu plano?</strong></li></ul><p><br></p><p class=\"ql-align-justify\"><span style=\"background-color: transparent;\">Nossos planos são vendidos individualmente, portanto, você deve adicionar a mesma quantidade de plano com a quantidade de participantes que irão utilizar os planos. Sendo que um dos participantes será o responsável financeiro. Após contratar o plano </span><strong style=\"background-color: transparent;\">não é permitida </strong><span style=\"background-color: transparent;\">a inclusão de novos participantes.</span></p><p><br></p><ul><li class=\"ql-align-justify\"><strong style=\"background-color: transparent;\">Qual a forma de pagamento?</strong></li></ul><p class=\"ql-align-justify\"><span style=\"background-color: transparent;\">A opção de pagamento está habilitada para cartão de crédito. </span>Temos a vantagem de não consumir seu limite total do cartão. Descontamos apenas o valor referente a mensalidade do plano contratado, pois o modelo de cobrança é em forma de recorrência, cobrando assim o valor contratado mensalmente no dia que foi feito o primeiro pagamento. Por exemplo: Se você contratar o plano no dia 16 de Fevereiro, será cobrado nos meses subsequentes, no dia 16, o valor contratado.</p><p><br></p><ul><li class=\"ql-align-justify\"><strong style=\"background-color: transparent;\">Temos um plano familiar?&nbsp;</strong></li></ul><p class=\"ql-align-justify\"><span style=\"background-color: transparent;\">Não, nossos planos são individuais.&nbsp;</span></p><p><br></p>'),(37,'Plano Individual','Monthly',7209,0,1,1,17,'2020-03-25 00:00:00','2021-03-16 18:24:22','41972