ipação 30%</p><p>▪ Reabilitação com Núcleo Metálico fundido/Núcleo Pré-Fabricado - Inclui a Peça Protética – co-participação 30%</p><p>▪ Reabilitação com Restauração Metálica Fundida (RMF) Unitária - Inclui a Peça Protética – co-participação 30%</p><p class=\"ql-align-justify\">▪ Reembasamento de Coroa Provisória</p>',1,'https://s3.us-east-1.amazonaws.com/arquivoscomprodonto/fotos_planos/1596549945_pplanoppr50p','<p>Plano Uniodonto</p><p>Ideal para quem quer realizar desde os procedimentos mais simples até os mais complexos, o Plano PPR50 é completo e possui um ótimo custo-benefício.</p><p>Através de uma pequena mensalidade, você tem cobertura de tratamentos em todas as áreas da odontologia.</p><p><br></p><p>Este plano tem cobertura nas seguintes especialidades:</p><p>• CONSULTA</p><p>• TRATAMENTO DE URGÊNCIA</p><p>• ENDODONTIA (CANAL)</p><p>• EXTRAÇÃO</p><p>• CIRURGIAS (EM CONSULTÓRIO)</p><p>• DENTÍSTICA RESTAURADORA (OBTURAÇÕES)</p><p>• PROFILAXIA (LIMPEZA)</p><p>Confira a cobertura completa em cobertura do plano.</p><p><br></p><p>Este convênio oferece desconto nos seguintes atos:</p><p>• TÉCNICAS DE HIGIENE BUCAL</p><p>• APLICAÇÃO DE FLÚOR E SELANTE</p><p>• RASPAGEM DE TÁRTARO</p><p>• RADIOGRAFIA DE DIAGNÓSTICO</p><p>• PRÓTESE E CONDICIONAMENTO</p><p><br></p><p>- Atos não cobertos (fora da cobertura contratual)</p><p>Para deixar o seu sorriso ainda mais bonito, qualquer outro tratamento que você quiser, a Uniodonto faz.</p><p>FAZ PRÓTESES.</p><p>FAZ IMPLANTES.</p><p>FAZ CLAREAMENTO.</p><p>FAZ TUDO ISSO E</p><p>MUITO MAIS.</p><p><br></p><p>Conheça outros benefícios do plano Ortodôntico Uniodonto:</p><p><br></p><p>- A maior rede de dentistas</p><p>A Uniodonto possui a maior rede de atendimento em Piracicaba e região. São mais de 350 dentistas cooperados na região e mais de 22.000 dentistas à sua disposição, atendendo em mais de 2.000 cidades brasileiras, cobrindo todo o território nacional, prontos para atender você sempre que precisar!</p><p><br></p><p>- Atendimento com hora marcada, no consultório do dentista de sua escolha</p><p><br></p><p>- Atendimento de todas as especialidades da odontologia</p><p><br></p><p>- Aprovação online</p><p>Faça sua consulta e aprove seu tratamento direto no consultório do dentista, simples, rápido e sem nenhuma burocracia.</p><p><br></p><p>- Atendimento 24h em todo o Brasil</p><p>Para casos de urgência, você tem cobertura nacional para os procedimentos de emergência. Em Piracicaba, você pode contar com atendimento 24h na Santa Casa de Piracicaba.</p><p><br></p><p>- Aplicativo Uniodonto Piracicaba</p><p class=\"ql-align-justify\">O aplicativo Uniodonto Piracicaba facilita a sua pesquisa dos dentistas cooperados que atendem o seu plano, além da carteirinha virtual Uniodonto, na palma da sua mão!</p>',0,1,NULL,'<ul><li class=\"ql-align-justify\"><strong style=\"background-color: transparent; color: rgb(119, 119, 119);\">Posso adicionar participantes ao meu plano?</strong></li></ul><p class=\"ql-align-justify\">&nbsp;</p><p class=\"ql-align-justify\"><span style=\"background-color: transparent;\">Nossos planos são vendidos individualmente, portanto, você deve adicionar a mesma quantidade de plano com a quantidade de participantes que irão utilizar os planos. Sendo que um dos participantes será o responsável financeiro. Após contratar o plano não é permitida a inclusão de novos participantes.</span></p><p class=\"ql-align-justify\">&nbsp;</p><ul><li class=\"ql-align-justify\"><strong style=\"background-color: transparent; color: rgb(119, 119, 119);\">Qual a forma de pagamento?</strong></li></ul><p class=\"ql-align-justify\"><span style=\"background-color: transparent;\">A opção de pagamento está habilitada para cartão de crédito. Temos a vantagem de não consumir seu limite total do cartão. Descontamos apenas o valor referente a mensalidade do plano contratado, pois o modelo de cobrança é em forma de recorrência, cobrando assim o valor contratado mensalmente no dia que foi feito o primeiro pagamento. Por exemplo: Se você contratar o plano no dia 16 de Fevereiro, será cobrado nos meses subsequentes, no dia 16, o valor contratado.</span></p><p class=\"ql-align-justify\">&nbsp;</p><ul><li class=\"ql-align-justify\"><strong style=\"background-color: transparent; color: rgb(119, 119, 119);\">Temos um plano familiar?&nbsp;</strong></li></ul><p class=\"ql-align-justify\"><span style=\"background-color: transparent;\">Não, nossos planos são individuais.</span></p><p><br></p><p><br></p>'),(39,'Plano Master Plus Ouro','Monthly',6200,1000,1,1,18,'2020-03-25 00:00:00','2020-12-01 13:23:34','457.362/08-5','<p><strong><em>Nº reg. Produto: </em></strong>457.362/08-5</p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\">A cobertura compreende os procedimentos exclusivamente odontológicos realizáveis em consultório, incluindo exames clínicos, procedimentos diagnósticos, atendimentos de urgência e emergência odontológicos, exames auxiliares ou complementares, tratamentos e demais procedimentos ambulatoriais solicitados pelo cirurgião-dentista com a finalidade de complementar o diagnóstico do paciente, tais como, radiologia, procedimentos de prevenção, dentística, endodontia, periodontia e cirurgia, conforme os procedimentos definidos e listados no Rol de Procedimentos e Eventos em Saúde editado pela Agência Nacional de Saúde Suplementar (ANS), específicos da segmentação odontológica, e suas atualizações.<strong> </strong></p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\"><strong style=\"color: black;\">1)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;URGÊNCIA/EMERGÊNCIA</strong></p><p class=\"ql-align-justify\"><span style=\"color: black;\">Colagem de Fragmentos Dentários </span></p><p class=\"ql-align-justify\"><span style=\"color: black;\">Controle de Hemorragia com ou sem Aplicação de Agente Hemostático</span></p><p class=\"ql-align-justify\"><span style=\"color: black;\">Incisão e Drenagem (Intra ou Extra-Oral) de Abscesso, Hematoma ou Flegmão da Região