lanos/1601553195_planoessencial24meses','<p>O plano Essencial é o que oferece a maior cobertura clínica para tratamento odontológico.</p><p>São cobertos procedimentos como restauração, limpeza, tratamento de canal, extração de dente, raspagem, atos em Odontopediatria e atendimento de urgência, entre outros.</p><p>Carência zero.</p><p>Atendimento nacional.</p><p>Possibilidade de incluir dependentes diretos e agregados (pai, mãe, sogros, netos, sobrinhos).</p><p><span style=\"color: rgb(0, 0, 0);\">Valor líquido, por pessoa admitida no plano odontológico da Uniodonto de São José dos Campos para contratação do plano Essencial (pessoa física).</span></p>',0,1,NULL,'<ul><li class=\"ql-align-justify\"><strong style=\"background-color: transparent;\">Posso adicionar participantes ao meu plano?</strong></li></ul><p><br></p><p class=\"ql-align-justify\"><span style=\"background-color: transparent;\">Nossos planos são vendidos individualmente, portanto, você deve adicionar a mesma quantidade de plano com a quantidade de participantes que irão utilizar os planos. Sendo que um dos participantes será o responsável financeiro. Após contratar o plano </span><strong style=\"background-color: transparent;\">não é permitida </strong><span style=\"background-color: transparent;\">a inclusão de novos participantes.</span></p><p><br></p><ul><li class=\"ql-align-justify\"><strong style=\"background-color: transparent;\">Qual a forma de pagamento?</strong></li></ul><p class=\"ql-align-justify\"><span style=\"background-color: transparent;\">A opção de pagamento está habilitada para cartão de crédito. </span>Temos a vantagem de não consumir seu limite total do cartão. Descontamos apenas o valor referente a mensalidade do plano contratado, pois o modelo de cobrança é em forma de recorrência, cobrando assim o valor contratado mensalmente no dia que foi feito o primeiro pagamento. Por exemplo: Se você contratar o plano no dia 16 de Fevereiro, será cobrado nos meses subsequentes, no dia 16, o valor contratado.</p><p><br></p><ul><li class=\"ql-align-justify\"><strong style=\"background-color: transparent;\">Qual a diferença dos planos 12, 24 e 36 meses ?</strong></li></ul><p><br></p><p class=\"ql-align-justify\"><span style=\"color: rgb(36, 41, 46);\">O Plano Essencial é para quem busca uma cobertura mais ampla, com procedimentos complexos e específicos: cobre cirurgias, próteses (coroas metálicas), obturações, extrações de dentes (sisos), tratamento de canal, radiografias, biópsia entre outros. 12,24 e 36 meses, é a vigência de cada plano contratado.&nbsp;</span></p><ul><li class=\"ql-align-justify\"><strong>Qual a diferença entre um plano e o outro? ( Plano Classic e Plano Essencial)</strong></li></ul><p class=\"ql-align-justify\"><span style=\"color: rgb(36, 41, 46);\">O Plano Classic oferece atendimento de urgência e emergência 24 horas com tratamentos, restaurações, limpeza, cuidados e reparos diários.&nbsp;</span></p><p class=\"ql-align-justify\"><span style=\"color: rgb(36, 41, 46);\">O Plano Essencial é para quem busca uma cobertura mais ampla, com procedimentos complexos e específicos: cobre cirurgias, próteses (coroas metálicas), obturações, extrações de dentes (sisos), tratamento de canal, radiografias, biópsia entre outros.</span></p><p><br></p><ul><li class=\"ql-align-justify\"><strong style=\"background-color: transparent;\">Eu recebo a carteirinha em casa?</strong></li></ul><p class=\"ql-align-justify\"><span style=\"background-color: transparent;\">Sim, em média 20 dias após a contratação de seu plano, você receberá sua carteirinha física no CEP informado.&nbsp;</span></p><p><br></p><ul><li class=\"ql-align-justify\"><strong style=\"background-color: transparent;\">Temos um plano familiar?&nbsp;</strong></li></ul><p class=\"ql-align-justify\"><span style=\"background-color: transparent;\">Não, nossos planos são individuais.&nbsp;</span></p><p><br></p><p><br></p>'),(42,'Plano Essencial 36 meses','Monthly',4070,0,1,1,19,'2020-03-25 00:00:00'