p;&nbsp;&nbsp;Remoção de odontoma</span></p><p><br></p><p class=\"ql-align-justify\"><strong style=\"color: rgb(38, 38, 38);\">PRÓTESE</strong><span style=\"color: black;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></p><p><span style=\"color: black;\">·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Restauração metálica fundida </span></p><p><span style=\"color: black;\">·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Remoção de núcleo intrarradicular </span></p><p><span style=\"color: black;\">·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Remoção de trabalho protético</span></p><p><span style=\"color: black;\">·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Núcleo metálico fundido/ seccionado </span></p><p><span style=\"color: black;\">·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Preparo para núcleo intrarradicular</span></p><p><span style=\"color: black;\">·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Pino pré fabricado</span></p><p><span style=\"color: black;\">·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Núcleo de preenchimento</span></p><p><span style=\"color: black;\">·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Coroa provisória com pino </span></p><p><span style=\"color: black;\">·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Coroa provisória sem pino </span></p><p><span style=\"color: black;\">·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Coroa total em cerômero dentes anteriores </span></p><p><span style=\"color: black;\">·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Coroa total metálica</span></p><p><br></p><p class=\"ql-align-justify\"><strong style=\"color: rgb(38, 38, 38);\">RADIOLOGIA</strong><span style=\"color: black;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></p><p><span style=\"color: black;\">·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Levantamento Radiográfico (exame radiodôntico)</span></p><p><span style=\"color: black;\">·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Radiografia periapical</span></p><p><span style=\"color: black;\">·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Radiografia interproximal - bite-wing</span></p><p><span style=\"color: black;\">·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Radiografia oclusal</span></p><p><span style=\"color: black;\">·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Radiografia panorâmica de mandíbula/maxila (ortopantomografia)</span></p><p><br></p><p class=\"ql-align-justify\"><strong style=\"color: rgb(38, 38, 38);\">DIAGNÓSTICO BUCAL (PATOLOGIA)</strong></p><p><strong style=\"color: black;\">Nomenclatura&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</strong></p><p><span style=\"color: black;\">·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Coleta de raspado em lesões ou sítios específicos da região buco-maxilo- facial</span></p><p><span style=\"color: black;\">·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Proservação</span></p><p><br></p><p class=\"ql-align-justify\"><strong style=\"color: rgb(38, 38, 38);\">TESTES E EXAMES DE LABORATÓRIO</strong></p><p><span style=\"color: black;\">·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Diagnóstico anatomopatológico em citologia esfoliativa na região buco-maxilo-facial</span></p><p><span style=\"color: black;\">·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Diagnóstico anatomopatológico em material de biópsia na região buco-maxilo-facial</span></p><p><span style=\"color: black;\">·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Diagnóstico anatomopatológico em peça cirúrgica na região buco-maxilo-facial</span></p><p><span style=\"color: black;\">·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Diagnóstico anatomopatológico em punção na região buco-maxilo-facial</span></p><p><span style=\"color: black;\">·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Teste de capacidade tampão da saliva</span></p><p><span style=\"color: black;\">·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Teste de fluxo salivar</span></p><p>·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span style=\"color: black;\">Teste de pH salivar</span></p>',1,'https://s3.us-east-1.amazonaws.com/arquivoscomprodonto/fotos_planos/1601553222_planoessencial36meses','<p>O plano Essencial é o que oferece a maior cobertura clínica para tratamento odontológico.</p><p>São cobertos procedimentos como restauração, limpeza, tratamento de canal, extração de dente, raspagem, atos em Odontopediatria e atendimento de urgência, entre outros.</p><p>Carência zero.</p><p>Atendimento nacional.</p><p>Possibilidade de incluir dependentes diretos e agregados (pai, mãe, sogros, netos, sobrinhos).</p><p><span style=\"color: rgb(0, 0, 0);\">Valor líquido, por pessoa admitida no plano odontológico da Uniodonto de São José dos Campos para contratação do plano Essencial (pessoa física).</span></p>',0,1,NULL,'<ul><li class=\"ql-align-justify\"><strong style=\"background-color: transparent;\">Posso adicionar participantes ao meu plano?</strong></li></ul><p><br></p><p class=\"ql-align-justify\"><span style=\"background-color: transparent;\">Nossos planos são vendidos individualmente, portanto, você deve adicionar a mesma quantidade de plano com a quantidade de participantes que irão utilizar os planos. Sendo que um dos participantes será o responsável financeiro. Após contratar o plano </span><strong style=\"background-color: transparent;\">não é permitida </strong><span style=\"background-color: transparent;\">a inclusão de novos participantes.</span></p><p><br></p><ul><li class=\"ql-align-justify\"><strong style=\"background-color: transparent;\">Qual a forma de pagamento?</strong></li></ul><p class=\"ql-align-justify\"><span style=\"background-color: transparent;\">A opção de pagamento está habilitada para cartão de crédito. </span>Temos a vantagem de não consumir seu limite total do cartão. Descontamos apenas o valor referente a mensalidade do plano contratado, pois o modelo de cobrança é em forma de recorrência, cobrando assim o valor contratado mensalmente no dia que foi feito o primeiro pagamento. Por exemplo: Se você contratar o plano no dia 16 de Fevereiro, será cobrado nos meses subsequentes, no dia 16, o valor contratado.</p><p class=\"ql-align-justify\"><br></p><ul><li class=\"ql-align-justify\"><strong style=\"background-color: transparent;\">Qual a diferença dos planos 12, 24 e 36 meses ?</strong></li></ul><p><br></p><p class=\"ql-align-justify\"><span style=\"color: rgb(36, 41, 46);\">O Plano Essencial é para quem busca uma cobertura mais ampla, com procedimentos complexos e específicos: cobre cirurgias, próteses (coroas metálicas), obturações, extrações de dentes (sisos), tratamento de canal, radiografias, biópsia entre outros. 12,24 e 36 meses, é a vigência de cada plano contratado.&nbsp;</span></p><ul><li class=\"ql-align-justify\"><strong>Qual a diferença entre um plano e o outro? ( Plano Classic e Plano Essencial)</strong></li></ul><p class=\"ql-align-justify\"><span style=\"color: rgb(36, 41, 46);\">O Plano Classic oferece atendimento de urgência e emergência 24 horas com tratamentos, restaurações, limpeza, cuidados e reparos diários.&nbsp;</span></p><p class=\"ql-align-justify\"><span style=\"color: rgb(36, 41, 46);\">O Plano Essencial é para quem busca uma cobertura mais ampla, com procedimentos complexos e específicos: cobre cirurgias, próteses (coroas metálicas), obturações, extrações de dentes (sisos), tratamento de canal, radiografias, biópsia entre outros.</span></p><p><br></p><ul><li class=\"ql-align-justify\"><strong style=\"background-color: transparent;\">Eu recebo a carteirinha em casa?</strong></li></ul><p class=\"ql-align-justify\"><span style=\"background-color: transparent;\">Sim, em média 20 dias após a contratação de seu plano, você receberá sua carteirinha física no CEP informado.&nbsp;</span></p><p><br></p><ul><li class=\"ql-align-justify\"><strong style=\"background-color: transparent;\">Temos um plano familiar?&nbsp;</strong></li></ul><p class=\"ql-align-justify\"><span style=\"background-color: transparent;\">Não, nossos planos são individuais.&nbsp;</span></p><p><br></p><p><br></p>'),(43,'Plano Classic','Monthly',2160,0,1,0,19,'2019-10-10 17:48:28','2020-09-18 15:21:08','433161003','<p><strong>O Plano Classic é feito para quem quer manter a saúde bucal em dia, gastando pouco.</strong></p><p><strong>Ele é indicado para quem precisa de tratamentos preventivos e periódicos.</strong></p><p><strong>E o melhor: sem nenhuma carência.</strong></p><p><br></p><p><strong style=\"color: rgb(38, 38, 38);\">COBERTURA DO PLANO CLASSIC</strong></p><p><br></p><p><strong style=\"color: rgb(38, 38, 38);\">CONSULTA E PROCEDIMENTOS DE URGÊNCIA</strong></p><p><span style=\"color: black;\">·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Consulta odontológica inicial</span></p><p><span style=\"color: black;\">·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Consulta odontológica</span></p><p><span style=\"color: black;\">·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Consulta odontológica para avaliação técnica de auditoria</span></p><p><span style=\"color: black;\">·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Consulta odontológica de urgência - 8h às 20h</span></p><p><span style=\"color: black;\">·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Consulta odontológica de urgência 24 hs - 20h às 8h</span></p><p><span style=\"color: black;\">·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Urgência consulta incluída - 8h às 20h exclusivo para plantonistas</span></p><p><span style=\"color: black;\">·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Urgência consulta incluída - 20h às 8h exclusivo para plantonistas</span></p><p><span style=\"color: black;\">·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Controle de hemorragia com aplicação de agente hemostático em região buco-maxilo-facial</span></p><p><span style=\"color: black;\">·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Controle de hemorragia sem aplicação de agente hemostático em região buco-maxilo-facial</spa