p><p>·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Exodontia para finalidade ortodôntica</p><p>·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Exodontia a retalho</p><p>·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Exodontia de raiz residual</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p><p class=\"ql-align-justify\">RADIOLOGIA&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p><p>·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Levantamento Radiográfico (exame radiodôntico)</p><p>·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Radiografia periapical</p><p>·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Radiografia interproximal - bite-wing</p><p>·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Radiografia oclusal</p><p class=\"ql-align-justify\">&nbsp;</p><p class=\"ql-align-justify\">DIAGNÓSTICO BUCAL (PATOLOGIA)</p><p>·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Coleta de raspado em lesões ou sítios específicos da região buco-maxilo- facial</p><p>·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Proservação</p>',0,0,NULL,NULL),(45,'PRV PF','Monthly',2970,500,1,1,16,'2020-12-03 15:31:22','2021-05-14 13:23:11','433.656/00-9','<p class=\"ql-align-center\">Resumo Plano Prev</p><p class=\"ql-align-justify\">O Plano Prev é destinado a pessoas que cuidam da Prevenção da saúde bucal. É um plano coparticipativo, que com uma pequena mensalidade o beneficiário adquire o direito a tratamentos em todas as áreas odontológicas e contempla todo Rol de Procedimentos da ANS (Agência Nacional de Saúde Suplementar).</p><p class=\"ql-align-justify\">&nbsp;</p><p><strong><u>PROCEDIMENTOS DE URGÊNCIA E EMERGÊNCIA</u></strong><sup><strong><u>1</u></strong></sup><strong>:</strong></p><p>Colagem de fragmento.</p><p>Curativo em caso de hemorragia bucal.</p><p>Curativo em caso de odontalgia aguda.</p><p>Imobilização dentária temporária.</p><p>Incisão e drenagem de abscesso.</p><p>Recimentação de peça protética.</p><p>Redução de luxação da ATM <sup>2</sup></p><p>Reimplante de dente avulsionado.</p><p>Tratamento de alveolite.</p><p><br></p><p class=\"ql-align-center\"><strong>COBERTURA ASSISTENCIAL </strong></p><p class=\"ql-align-center\"><strong>SEM COPARTICIPAÇÃO</strong><sup><strong>3</strong></sup><strong> </strong></p><p class=\"ql-align-center\"><strong>&nbsp;(CARÊNCIA DE 90 DIAS)</strong></p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\"><strong><u>DIAGNÓSTICO</u>:</strong></p><p>Consulta Inicial</p><p><strong><u>PREVENÇÃO</u>:</strong></p><p>Aplicação tópica profissional de flúor </p><p>Controle ou evidenciação de placa bacteriana / técnica de escovação. <sup>6</sup></p><p>Orientação sobre cárie dental, doença periodontal, câncer bucal.</p><p>Orientação sobre manutenção de próteses; uso de dentifrícios e enxaguatórios.</p><p>Profilaxia e polimento coronário.</p><p><strong><u>ODONTOPEDIATRIA</u>:</strong></p><p>Aplicação de selante. <sup>4</sup></p><p>Capeamento pulpar em decíduos.</p><p>Condicionamento em odontologia. <sup>12</sup></p><p>Exodontia de dentes decíduos.</p><p><strong><u>DENTISTICA</u></strong><sup><strong><u>5</u></strong></sup><strong><u>:</u></strong></p><p>Restauração à amálgama/ionômero de 1 superfície.</p><p>Restauração à amálgama/ionômero de 2 superfície.</p><p>Restauração à amálgama/ionômero de 3 superfície.</p><p>Restauração à amálgama/ionômero de 4 superfície.</p><p><strong><u>ENDODONTIA</u>:</strong></p><p>Capeamento pulpar (excluindo restauração final).</p><p><strong><u>PERIODONTIA</u>:</strong></p><p>Drenagem de abscesso periodontal.</p><p>Raspagem, alisamento e polimento coronário (preparo inicial / tartarectomia).</p><p><strong><u>CIRURGIA</u>:</strong></p><p>Apicetomia birradicular com obturação retrógrada.</p><p>Apicetomia birradicular.</p><p>Apicetomia trirradicular com obturação retrógrada.</p><p>Apicetomia unirradicular com obturação retrógrada.</p><p>Apicetomia unirradicular.</p><p>Cirurgia de tórus mandibular – bilateral.</p><p>Cirurgia de tórus mandibular – unilateral.</p><p>Exodontia (por elemento).</p><p><br></p><p class=\"ql-align-center\"><strong>COBERTURA ASSISTENCIAL </strong></p><p class=\"ql-align-center\"><strong>COM COPARTICIPAÇÃO </strong></p><p class=\"ql-align-center\"><strong>(CARÊNCIA DE 90 DIAS)</strong></p><p class=\"ql-align-center\"><br></p><p><strong><u>RADIOLOGIA</u>:</strong></p><p>RX Bite-Wing (interproximal)</p><p>RX Oclusal</p><p>RX Periapical.</p><p><strong><u>TESTE E EXAME DE LABORATÓRIO</u>:</strong></p><p>Exame histopatológico.</p><p><strong><u>ODONTOPEDIATRIA</u>:</strong></p><p>Adequação do meio bucal. <sup>8</sup></p><p>Aplicação de cariostático. <sup>7</sup></p><p>Pulpotomia.</p><p>Tratamento endodôntico em decíduos.</p><p>Ulectomia.</p><p>Ulotomia.</p><p><strong><u>DENTÍSTICA</u></strong><sup><strong><u>9</u></strong></sup><strong>:</strong></p><p>Núcleo de preenchimento em amálgama, resina fotopolimerizável, resina quimicamente ativada ou ionômero de vidro.</p><p>Faceta em resina fotopolimerizável</p><p>Restauração a pino.</p><p>Restauração de 1 superfície.</p><p>Restauração de 2 superfícies.</p><p>Restauração de 3 superfícies.</p><p>Restauração de 4 superfícies.</p><p>Restauração de ângulo.</p><p>Restauração de superfície radicular.</p><p><strong><u>ENDODONTIA</u>:</strong></p><p>Preparo para núcleo</p><p>Pulpotomia.</p><p>Remoção de obturação radicular.</p><p>Remoção de prótese e/ou pino metálico intracanal.</p><p>Retratamento endodôntico</p><p>Tratamento de perfuração radicular</p><p>Tratamento endodôntico com rizogênese incompleta.</p><p>Tratamento endodôntico em dentes permanentes (1 conduto)</p><p>Tratamento endodôntico em dentes permanentes (2 condutos)</p><p>Tratamento endodôntico em dentes permanentes (3 condutos)</p><p>Tratamento endodôntico em dentes permanentes (4 condutos)</p><p><strong><u>PERIODONTIA</u>:</strong></p><p>Ajuste oclusal</p><p>Aumento da coroa clínica</p><p>Cirurgia periodontal a retalho</p><p>Cunha distal</p><p>Curetagem de bolsa periodontal.</p><p>Enxerto livre ou pediculado</p><p>Gengivectomia.</p><p>Imobilização dentária temporária ou permanente</p><p>Raspagem, alisamento e polimento radicular.</p><p>Sepultamento radicular</p><p><strong><u>CIRURGIA:</u></strong></p><p>Alveoloplastia.</p><p>Biópsia. <sup>10</sup></p><p>Cirurgia de tórus palatino.</p><p>Correção de brida muscular.</p><p>Excisão de mucocele. </p><p>Excisão de rânula.</p><p>Exodontia de raiz residual (por elemento).</p><p>Frenectomia labial.</p><p>Frenectomia lingual.</p><p>Hemissecção com ou sem amputação radicular.</p><p>Reconstrução do sulco gengivo-labial.</p><p>Remoção dente retido (incluso ou impactado).</p><p>Sulcoplastia.</p><p><br></p><p class=\"ql-align-center\"><strong>COBERTURA ASSITENCIAL</strong></p><p class=\"ql-align-center\"><strong>COM COPARTICIPAÇÃO</strong></p><p class=\"ql-align-center\"><strong>CARÊNCIA 180 DIAS</strong></p><p class=\"ql-align-center\"><br></p><p><strong><u>RADIOLOGIA</u>:</strong></p><p>Panorâmica da mandíbula / maxila. <sup>11</sup></p><p><strong><u>PREVENÇÃO EM SAÚDE BUCAL</u>:</strong></p><p>Teste de fluxo salivar.</p><p><strong><u>ODONTOPEDIATRIA</u>:</strong></p><p>Reabilitação com coroa de acetato / aço ou policarbonato. <sup>13</sup></p><p><strong><u>CIRURGIA</u>:</strong></p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Aprofundamento de vestíbulo</p><p>Exérese de cistos de mandíbula / maxila. <sup>14</sup></p><p>Fratura alvéolo-dentária (redução cruenta/ incruenta)</p><p>Punção aspirativa.</p><p>Remoção de cálculo salivar/ lipoma</p><p>Tratamento cirúrgico de fistulas buço-nasal ou buço-sinusal. <sup>15</sup></p><p>Tratamento cirúrgico de tumores benignos e hiperplasias de tecidos ósseos / cartilaginosos na mandíbula / maxila. <sup>16</sup></p><p>Tratamento cirúrgico de tumores benignos e hiperplasias de tecidos moles na mandíbula / maxila. <sup>17</sup></p><p>Tratamento cirúrgico de tumores benignos odontogênicos sem reconstrução. <sup>18</sup></p><p><strong><u>PRÓTESE</u>;</strong></p><p>Cora total metálica. <sup>21</sup></p><p>Coroa total de cerômero em dentes anteriores. <sup>20</sup></p><p>Coroa unitária provisória (preparo de RMF). <sup>19</sup></p><p>Núcleo metálico fundido. <sup>22</sup></p><p>Restauração metálica fundida. <sup>23</sup></p><p><br></p><p><sup> </sup>1.<strong>PLANTÃO 24 HORAS: 9 9977-7006</strong></p><p>	2.<strong>REDUÇAO DE LUXAÇÃO DA ATM&nbsp;</strong></p><p>Cobertura obrigatória na segmentação odontológica quando o procedimento for passível de realização em ambiente ambulatorial, conforme indicação do cirurgião – dentista assistente.</p><p>	3.<strong> COPARTICIPAÇÃO</strong></p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Percentual de participação no valor dos atos odontológicos conforme estipulado em contrato</p><p>	4.<strong> APLICAÇÃO DE SELANTE</strong></p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Cobertura obrigatória quando preenchido pelo menos um dos seguintes critérios, conforme indicação do cirurgião dentista assistente:</p><p><strong>a.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</strong>Procedimento restaurador minimamente invasivo em dentes decíduos e permanentes;</p><p><strong>b.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</strong>Procedimento preventivo em fóssulas e fissuras de dentes decíduos e permanentes.</p><p>5. <strong>TRATAMENTO CONSERVADOR COM AMÁLGAMA, RESINA QUIMICAMENTE ATIVA OU IONÔMERO DE VIDRO</strong></p><p>6.<strong>CONTROLE OU EVIDENCIAÇÃO DE PLACA BACTERIANA / TECNICA DE ESCOVAÇÃO</strong></p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Até 14 anos de idade</p><p><br></p><p>7. <strong>APLICAÇÃO DE CARIOSTÁTICO </strong></p><p>&nbsp;&nbsp;Cobertura obrigatória como tratamento provisório em dentes decíduos, visando interromper a atividade da cárie, devendo ser seguido de um tratamento restaurador e associado a ações de promoção da saúde e prevenção de doenças, conforme indicação do cirurgião dentista assistente.</p><p>8. <strong>ADEQUAÇÃO DO MEIO BUCAL</strong></p><p>Cobertura obrigatória como tratamento preliminar ao tratamento restaurador, conforme indicação do cirurgião dentista assistente.</p><p><br></p><p>9.<strong>TRATAMENTO CONSERVADOR COM RESINA FOTOPOLIMERIZÁVEL</strong></p><p>10.<strong> BIÓPSIA DE BOCA</strong></p><p>Para a segmentação odontológica, a cobertura será obrigatória quando a extensão, localização e características da lesão &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;permitirem a realização do procedimento em ambiente ambulatorial, conforme indicação do cirurgião dentista assistente.</p><p>·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<strong>BIÓPSIA DE GLANDULA SALIVAR</strong></p><p>Para a segmentação odontológica, a cobertura será obrigatória quando a extensão, localização e características da lesão permitirem a realização do procedimento em ambiente ambulatorial, conforme indicação do cirurgião dentista assistente.</p><p>·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<strong>BIÓPSIA DE LÍNGUA </strong></p><p>Para a segmentação odontológica, a cobertura será obrigatória quando a extensão e características da lesão permitirem a realização do procedimento em ambiente ambulatorial, conforme indicação do cirurgião dentista assistente.</p><p>·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<strong>BIÓPSIA DE MANDÍBULA / MAXILA </strong></p><p>Para a segmentação odontológica, a cobertura será obrigatória quando a extensão, localização e característica da lesão permitirem a realização do procedimento em ambiente ambulatorial, conforme indicação do cirurgião dentista assistente.</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;11. <strong>PANORÂMICA DE MANDÍBULA/MAXILA</strong></p><p><strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;(ORTOPANTOMOGRAFIA)</strong></p><p>Cobertura obrigatória na segmentação odontológica como auxílio diagnóstico; pré e/ou pós procedimento cirúrgico odontológico.</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;12. <strong>CONDICIONAMENTO EM ODONTOLOGIA</strong></p><p>Cobertura mínima obrigatória de 3 (três) sessões/ ano para beneficiários com comportamento não cooperativo/de difícil manejo, conforme indicação do cirurgião dentista assistente.</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;13. <strong>REABILITAÇÃO COMO COROA DE ACETATO/AÇO OU POLICARBONATO</strong></p><p>Cobertura obrigatória quando preenchido pelo menos um dos seguintes critérios, conforme indicação do cirurgião dentista assistente:</p><p>a)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Dentes decíduos não passiveis de reconstrução por meio direto;</p><p>b)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Dentes permanentes em pacientes não cooperativos/de difícil manejo.</p><p><br></p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;14. <strong>EXÉRESE DE PEQUENOS CISTOS DE MANDÍBULA / MAXILA</strong></p><p>Para a segmentação odontológica, a cobertura será obrigatória quando a localização e características da lesão permitirem a realização do procedimento em ambiente ambulatorial, conforme indicação do cirurgião dentista assistente.</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;15. <strong>TRATAMENTO CIRÚRGICO DE FÍSTULA BUCO-NASAL OU BUCO-SINUSAIS</strong></p><p>Para a segmentação odontológica, a cobertura será obrigatória quando a extensão, localização e característica da lesão permitirem a realização do procedimento em ambiente ambulatorial, conforme indicação do cirurgião dentista assistente.</p><p><br></p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;16. <strong>TRATAMENTO CIRÚRGICO DE TUMORES BENIGNOS E HIPERPLASIAS DE TECIDO ÓSSEOS/ &nbsp;&nbsp;&nbsp;CARTILOGINOSOS NA MANDÍBULA/ MAXILA</strong></p><p>Para a segmentação odontológica, a cobertura será obrigatória quando a extensão, localização e característica da lesão permitirem a realização do procedimento em ambiente ambulatorial, conforme indicação do cirurgião dentista assistente.</p><p>&nbsp;17. <strong>TRATAMENTO CIRÚRGICO DE TUMORES BENIGNOS E HIPERPLASIAS DE TECIDOS MOLES DA &nbsp;&nbsp;REGIÃO BUCO- MAXILO-FACIAL</strong></p><p>Para segmentação odontológica, a cobertura será obrigatória quando a extensão, localização e características da lesão permitirem a realização do procedimento em ambiente ambulatorial, conforme a indicação do cirurgião dentista assistente.</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;18. <strong>TRATAMENTO CIRÚRGICO DE TUMORES BENIGNOS ODONTOGENICOS SEM RECONSTRUÇÃO</strong></p><p>&nbsp;&nbsp;Para a segmentação odontológica, a cobertura será obrigatória quando a extensão, localização e características da lesão&nbsp;&nbsp;&nbsp;&nbsp;permitirem a realização do procedimento em ambiente ambulatorial, conforme indicação do cirurgião dentista assistente.</p><p>&nbsp;&nbsp;&nbsp;19. <strong>COROA UNITARIA PROVISÓRIA COM OU SEM PINO/ PROVISÓRIO PARA PREPARO DE &nbsp;&nbsp;RESTAURAÇÃO METÁLICA FUNDIDA (RMF)</strong></p><p>Cobertura obrigatória como procedimento de caráter provisório, em dentes permanentes não passiveis de reconstrução por meio direto, conforme indicação do cirurgião dentista assistente.</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;20. &nbsp;<strong>REABILITAÇÃO COM COROA TOTAL DE CEROMERO UNITÁRIA - INCLUI A PEÇA PROTÉTICA</strong></p><p>Cobertura obrigatória em dentes permanentes anteriores (incisivos e caninos) não passíveis de reconstrução por meio &nbsp;&nbsp;direto, conforme indicação do cirurgião dentista assistente.</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;21. &nbsp;<strong>REABILITAÇÃO COM COROA TOTAL METÁLICA UNITÁRIA – INCLUI A PEÇA PROTÉTICA </strong></p><p>Cobertura obrigatória em dentes permanentes posteriores (pré-molares e molares) não passíveis de reconstrução por meio direto nem Restauração Metálica Fundida, conforme indicação do cirurgião dentista assistente.</p><p>&nbsp;&nbsp;&nbsp;22. &nbsp;<strong>REABILITAÇÃO COM NÚCLEO METÁLICO FUNDIDO/NÚCLEO PRÉ –FABRICADO-INCLUI A PEÇA PROTÉTICA</strong></p><p>Cobertura obrigatória em dentes permanentes com tratamento endodôntico prévio, conforme indicação do cirurgião dentista assistente.</p><p>&nbsp;&nbsp;&nbsp;23. &nbsp;<strong>REABILITAÇÃO COM RESTAURAÇÃO METÁLICA FUNDIDA (RMF) UNITÁRIA –INCLUI A PEÇA PROTÉTICA</strong></p><p>Cobertura obrigatória em dentes permanentes posteriores quando preenchido pelo menos um dos seguintes critérios, conforme indicação do cirurgião dentista assistente:</p><p>a)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Dentes com comprometimento de 3 (três) ou mais faces, não passiveis de reconstrução por meio direto;</p><p>b)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Dentes com comprometimento de cúspide funcional, independentemente do número de faces afetadas.</p><p><strong>ATOS NÃO COBERTOS PELO ROL DA ANS SERÃO COBRADOS PELA TABELA PRÓPRIA DA UNIODONTO JUIZ DE FORA</strong></p>',1,'https://s3.us-east-1.amazonaws.com/arquivoscomprodonto/fotos_planos/1620998591_prvpf','<p class=\"ql-align-justify\">O Plano Prev é destinado a pessoas que cuidam da Prevenção da saúde bucal. É um plano coparticipativo, que com uma pequena mensalidade o beneficiário adquire o direito a tratamentos em todas as áreas odontológicas e contempla todo Rol de Procedimentos da ANS (Agência Nacional de Saúde Suplementar). Esse Rol de Procedimentos garante a cobertura de mais de 150 atos relacionados aos procedimentos mais realizados na Odontologia</p><p class=\"ql-align-justify\">Este plano possui uma cobertura sem coparticipação dos procedimentos preventivos e nos casos de tratamentos canal, gengiva, obturações, extrações, radiografias o beneficiário arca com 50% do valor da Tabela da Uniodonto.</p><p class=\"ql-align-justify\">Vantagens como segurança, comodidade e confiabilidade também devem ser levadas em conta na hora de escolher o plano. Estará a sua disposição consultas periódicas com profissionais competentes, sem gastar muito. Porque torna-se primordial investir na saúde pessoal.</p><p><br></p>',127,0,30,'<ul><li class=\"ql-align-justify\"><strong style=\"background-color: transparent;\">Posso adicionar participantes ao meu plano?</strong></li></ul><p><br></p><p class=\"ql-align-justify\"><span style=\"background-color: transparent;\">Nossos planos são vendidos individualmente, portanto, você deve adicionar a mesma quantidade de plano com a quantidade de participantes que irão utilizar os planos. Sendo que um dos participantes será o responsável financeiro. Após contratar o plano </span><strong style=\"background-color: transparent;\">não é permitida </strong><span style=\"background-color: transparent;\">a inclusão de novos participantes.</span></p><p><br></p><ul><li class=\"ql-align-justify\"><strong style=\"background-color: transparent;\">Qual a forma de pagamento?</strong></li></ul><p class=\"ql-align-justify\"><span style=\"background-color: transparent;\">A opção de pagamento está habilitada para cartão de crédito. </span>Temos a vantagem de não consumir seu limite total do cartão. Descontamos apenas o valor referente a mensalidade do plano contratado, pois o modelo de cobrança é em forma de recorrência, cobrando assim o valor contratado mensalmente no dia que foi feito o primeiro pagamento. Por exemplo: Se você contratar o plano no dia 16 de Fevereiro, será cobrado nos meses subsequentes, no dia 16, o valor contratado.</p><p><br></p><ul><li class=\"ql-align-justify\"><strong style=\"background-color: transparent;\">Temos um plano familiar?&nbsp;</strong></li></ul><p class=\"ql-align-justify\"><span style=\"background-color: transparent;\">Não, nossos planos são individuais.&nbsp;</span></p><p><br></p>'),(46,'KIDS PF','Monthly',2970,500,1,1,16,'2020-12-03 15:36:05','2021-05-14 14:24:58','431.718/00-1','<p><strong><u>PROCEDIMENTOS DE URGÊNCIA E EMERGÊNCIA</u></strong><sup><strong><u>1</u></strong></sup><s