ão e característica da lesão permitirem a realização do procedimento em ambiente ambulatorial, conforme indicação do cirurgião dentista assistente.</p><p><br></p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;16. <strong>TRATAMENTO CIRÚRGICO DE TUMORES BENIGNOS E HIPERPLASIAS DE TECIDO ÓSSEOS/ &nbsp;&nbsp;&nbsp;CARTILOGINOSOS NA MANDÍBULA/ MAXILA</strong></p><p>Para a segmentação odontológica, a cobertura será obrigatória quando a extensão, localização e característica da lesão permitirem a realização do procedimento em ambiente ambulatorial, conforme indicação do cirurgião dentista assistente.</p><p>&nbsp;17. <strong>TRATAMENTO CIRÚRGICO DE TUMORES BENIGNOS E HIPERPLASIAS DE TECIDOS MOLES DA &nbsp;&nbsp;REGIÃO BUCO- MAXILO-FACIAL</strong></p><p>Para segmentação odontológica, a cobertura será obrigatória quando a extensão, localização e características da lesão permitirem a realização do procedimento em ambiente ambulatorial, conforme a indicação do cirurgião dentista assistente.</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;18. <strong>TRATAMENTO CIRÚRGICO DE TUMORES BENIGNOS ODONTOGENICOS SEM RECONSTRUÇÃO</strong></p><p>&nbsp;&nbsp;Para a segmentação odontológica, a cobertura será obrigatória quando a extensão, localização e características da lesão&nbsp;&nbsp;&nbsp;&nbsp;permitirem a realização do procedimento em ambiente ambulatorial, conforme indicação do cirurgião dentista assistente.</p><p>&nbsp;&nbsp;&nbsp;19. <strong>COROA UNITARIA PROVISÓRIA COM OU SEM PINO/ PROVISÓRIO PARA PREPARO DE &nbsp;&nbsp;RESTAURAÇÃO METÁLICA FUNDIDA (RMF)</strong></p><p>Cobertura obrigatória como procedimento de caráter provisório, em dentes permanentes não passiveis de reconstrução por meio direto, conforme indicação do cirurgião dentista assistente.</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;20. &nbsp;<strong>REABILITAÇÃO COM COROA TOTAL DE CEROMERO UNITÁRIA - INCLUI A PEÇA PROTÉTICA</strong></p><p>Cobertura obrigatória em dentes permanentes anteriores (incisivos e caninos) não passíveis de reconstrução por meio &nbsp;&nbsp;direto, conforme indicação do cirurgião dentista assistente.</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;21. &nbsp;<strong>REABILITAÇÃO COM COROA TOTAL METÁLICA UNITÁRIA – INCLUI A PEÇA PROTÉTICA </strong></p><p>Cobertura obrigatória em dentes permanentes posteriores (pré-molares e molares) não passíveis de reconstrução por meio direto nem Restauração Metálica Fundida, conforme indicação do cirurgião dentista assistente.</p><p>&nbsp;&nbsp;&nbsp;22. &nbsp;<strong>REABILITAÇÃO COM NÚCLEO METÁLICO FUNDIDO/NÚCLEO PRÉ –FABRICADO-INCLUI A PEÇA PROTÉTICA</strong></p><p>Cobertura obrigatória em dentes permanentes com tratamento endodôntico prévio, conforme indicação do cirurgião dentista assistente.</p><p>&nbsp;&nbsp;&nbsp;23. &nbsp;<strong>REABILITAÇÃO COM RESTAURAÇÃO METÁLICA FUNDIDA (RMF) UNITÁRIA –INCLUI A PEÇA PROTÉTICA</strong></p><p>Cobertura obrigatória em dentes permanentes posteriores quando preenchido pelo menos um dos seguintes critérios, conforme indicação do cirurgião dentista assistente:</p><p>a)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Dentes com comprometimento de 3 (três) ou mais faces, não passiveis de reconstrução por meio direto;</p><p>b)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Dentes com comprometimento de cúspide funcional, independentemente do número de faces afetadas.</p><p class=\"ql-align-center\"><strong>ATOS NÃO COBERTOS PELO ROL DA ANS SERÃO COBRADOS PELA TABELA PRÓPRIA DA UNIODONTO JUIZ DE FORA</strong></p><p><br></p>',1,'https://s3.us-east-1.amazonaws.com/arquivoscomprodonto/fotos_planos/1621002297_kidspf','<p class=\"ql-align-justify\">O Plano Kids é destinado a crianças de zero a quatorze anos que cuidam da Prevenção da saúde bucal. É um plano coparticipativo, que com uma pequena mensalidade a criança adquire o direito a tratamentos em todas as áreas odontológicas e contempla todo Rol de Procedimentos da ANS (Agência Nacional de Saúde Suplementar).</p><p class=\"ql-align-justify\">O Plano Kids tem a vantagem de proporcionar aos pais/ responsáveis o acompanhamento da evolução da criança com compromisso com a prevenção para que ela não venha a ter cáries dentárias ou doenças da gengiva.</p><p><br></p>',127,0,30,'<ul><li class=\"ql-align-justify\"><strong style=\"background-color: transparent;\">Posso adicionar participantes ao meu plano?</strong></li></ul><p><br></p><p class=\"ql-align-justify\"><span style=\"background-color: transparent;\">Nossos planos são vendidos individualmente, portanto, você deve adicionar a mesma quantidade de plano com a quantidade de participantes que irão utilizar os planos. Sendo que um dos participantes será o responsável financeiro. Após contratar o plano </span><strong style=\"background-color: transparent;\">não é permitida </strong><span style=\"background-color: transparent;\">a inclusão de novos participantes.</span></p><p><br></p><ul><li class=\"ql-align-justify\"><strong style=\"background-color: transparent;\">Qual a forma de pagamento?</strong></li></ul><p class=\"ql-align-justify\"><span style=\"background-color: transparent;\">A opção de pagamento está habilitada para cartão de crédito. </span>Temos a vantagem de não consumir seu limite total do cartão. Descontamos apenas o valor referente a mensalidade do plano contratado, pois o modelo de cobrança é em forma de recorrência, cobrando assim o valor contratado mensalmente no dia que foi feito o primeiro pagamento. Por exemplo: Se você contratar o plano no dia 16 de Fevereiro, será cobrado nos meses subsequentes, no dia 16, o valor contratado.</p><p><br></p><ul><li class=\"ql-align-justify\"><strong style=\"background-color: transparent;\">Qual idade atende o plano Kids?</strong></li></ul><p class=\"ql-align-justify\"><span style=\"background-color: transparent;\">O plano Kids atende crianças de 0 a 17 anos.&nbsp;</span></p><p><br></p><ul><li class=\"ql-align-justify\"><strong style=\"background-color: transparent;\">Temos um plano familiar?&nbsp;</strong></li></ul><p class=\"ql-align-justify\"><span style=\"background-color: transparent;\">Não, nossos planos são individuais.&nbsp;</span></p><p><br></p>'),(47,'Uniprogressivo 2 pessoas','Monthly',8200,3000,1,1,12,'2020-12-08 21:17:18','2021-03-16 18:28:45','444.820/03-1','<p><em>Plano Uniprogressivo Pessoa Física&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Nº reg. Produto: 444.820/03-1</em></p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\">A cobertura deste plano se refere aos serviços exclusivamente odontológicos conforme rol editado pela Agência Nacional de Saúde Suplementar, e suas atualizações.&nbsp;</p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\">URGÊNCIA/EMERGÊNCIA</p><ul><li>Colagem de Fragmentos Dentários</li><li>Controle de Hemorragia com ou sem Aplicação de Agente Hemostático</li><li>Incisão e Drenagem (Intra ou Extra-Oral) de Abscesso, Hematoma ou Flegmão da Região Buco-Maxilo-Facial</li><li>Imobilização Dentária</li><li>Recimentação de Peça/Trabalho Protético</li><li>Redução de Luxação da Atm</li><li>Reimplante de Dente Avulsionado com Contenção</li><li>Sutura de Ferida Buco-Maxilo-Facial&nbsp;</li><li>Tratamento de Abscesso Periodontal</li><li>Tratamento de Alveolite</li><li>Tratamento de Odontalgia Aguda</li></ul><p class=\"ql-align-justify\">&nbsp;</p><p class=\"ql-align-justify\">DIAGNÓSTICO</p><ul><li>Consulta Odontológica Inicial</li></ul><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\">CONDICIONAMENTO</p><ul><li>Condicionamento em Odontologia</li></ul><p class=\"ql-align-justify\">&nbsp;</p><p class=\"ql-align-justify\">EXAMES</p><ul><li>Procedimento Diagnóstico Anatomopatológico (em Peça Cirúrgica, Material de Punção/Biópsia e Citologia Esfoliativa da Região Bucomaxilo-Facial)</li><li>Teste de Fluxo Salivar</li><li>Teste PH da Sali