as da lesão permitirem a realização do procedimento em ambiente ambulatorial, conforme indicação do cirurgião dentista assistente.</p><p>• BIÓPSIA DE GLANDULA SALIVAR</p><p>Para a segmentação odontológica, a cobertura será obrigatória quando a extensão, localização e características da lesão permitirem a realização do procedimento em ambiente ambulatorial, conforme indicação do cirurgião dentista assistente.</p><p>• BIÓPSIA DE LÍNGUA</p><p>Para a segmentação odontológica, a cobertura será obrigatória quando a extensão e características da lesão permitirem a realização do procedimento em ambiente ambulatorial, conforme indicação do cirurgião dentista assistente.</p><p>• BIÓPSIA DE MANDÍBULA / MAXILA</p><p>Para a segmentação odontológica, a cobertura será obrigatória quando a extensão, localização e característica da lesão permitirem a realização do procedimento em ambiente ambulatorial, conforme indicação do cirurgião dentista assistente.</p><p>11. PANORÂMICA DE MANDÍBULA/MAXILA</p><p>(ORTOPANTOMOGRAFIA)</p><p>Cobertura obrigatória na segmentação odontológica como auxílio diagnóstico; pré e/ou pós procedimento cirúrgico odontológico.</p><p>12. CONDICIONAMENTO EM ODONTOLOGIA</p><p>Cobertura mínima obrigatória de 3 (três) sessões/ ano para beneficiários com comportamento não cooperativo/de difícil manejo, conforme indicação do cirurgião dentista assistente.</p><p>13. REABILITAÇÃO COMO COROA DE ACETATO/AÇO OU POLICARBONATO</p><p>Cobertura obrigatória quando preenchido pelo menos um dos seguintes critérios, conforme indicação do cirurgião dentista assistente:</p><p>a) Dentes decíduos não passiveis de reconstrução por meio direto;</p><p>b) Dentes permanentes em pacientes não cooperativos/de difícil manejo.</p><p>14. EXÉRESE DE PEQUENOS CISTOS DE MANDÍBULA / MAXILA</p><p>Para a segmentação odontológica, a cobertura será obrigatória quando a localização e características da lesão permitirem a realização do procedimento em ambiente ambulatorial, conforme indicação do cirurgião dentista assistente.</p><p>15. TRATAMENTO CIRÚRGICO DE FÍSTULA BUCO-NASAL OU BUCO-SINUSAIS</p><p>Para a segmentação odontológica, a cobertura será obrigatória quando a extensão, localização e característica da lesão permitirem a realização do procedimento em ambiente ambulatorial, conforme indicação do cirurgião dentista assistente.</p><p>16. TRATAMENTO CIRÚRGICO DE TUMORES BENIGNOS E HIPERPLASIAS DE TECIDO ÓSSEOS/ CARTILOGINOSOS NA MANDÍBULA/ MAXILA</p><p>Para a segmentação odontológica, a cobertura será obrigatória quando a extensão, localização e característica da lesão permitirem a realização do procedimento em ambiente ambulatorial, conforme indicação do cirurgião dentista assistente.</p><p>17. TRATAMENTO CIRÚRGICO DE TUMORES BENIGNOS E HIPERPLASIAS DE TECIDOS MOLES DA REGIÃO BUCO- MAXILO-FACIAL</p><p>Para segmentação odontológica, a cobertura será obrigatória quando a extensão, localização e características da lesão permitirem a realização do procedimento em ambiente ambulatorial, conforme a indicação do cirurgião dentista assistente.</p><p>18. TRATAMENTO CIRÚRGICO DE TUMORES BENIGNOS ODONTOGENICOS SEM RECONSTRUÇÃO</p><p>Para a segmentação odontológica, a cobertura será obrigatória quando a extensão, localização e características da lesão permitirem a realização do procedimento em ambiente ambulatorial, conforme indicação do cirurgião dentista assistente.</p><p>19. COROA UNITARIA PROVISÓRIA COM OU SEM PINO/ PROVISÓRIO PARA PREPARO DE RESTAURAÇÃO METÁLICA FUNDIDA (RMF)</p><p>Cobertura obrigatória como procedimento de caráter provisório, em dentes permanentes não passiveis de reconstrução por meio direto, conforme indicação do cirurgião dentista assistente.</p><p>20. REABILITAÇÃO COM COROA TOTAL DE CEROMERO UNITÁRIA - INCLUI A PEÇA PROTÉTICA</p><p>Cobertura obrigatória em dentes permanentes anteriores (incisivos e caninos) não passíveis de reconstrução por meio direto, conforme indicação do cirurgião dentista assistente.</p><p>21. REABILITAÇÃO COM COROA TOTAL