perfície.</p><p>Restauração de 2 superfícies.</p><p>Restauração de 3 superfícies.</p><p>Restauração de 4 superfícies.</p><p>Restauração de ângulo.</p><p>Restauração de superfície radicular.</p><p><strong><u>ENDODONTIA</u>:</strong></p><p>Preparo para núcleo</p><p>Pulpotomia.</p><p>Remoção de obturação radicular.</p><p>Remoção de prótese e/ou pino metálico intracanal.</p><p>Retratamento endodôntico</p><p>Tratamento de perfuração radicular</p><p>Tratamento endodôntico com rizogênese incompleta.</p><p>Tratamento endodôntico em dentes permanentes (1 conduto)</p><p>Tratamento endodôntico em dentes permanentes (2 condutos)</p><p>Tratamento endodôntico em dentes permanentes (3 condutos)</p><p>Tratamento endodôntico em dentes permanentes (4 condutos)</p><p><strong><u>PERIODONTIA</u>:</strong></p><p>Ajuste oclusal</p><p>Aumento da coroa clínica</p><p>Cirurgia periodontal a retalho</p><p>Cunha distal</p><p>Curetagem de bolsa periodontal.</p><p>Enxerto livre ou pediculado</p><p>Gengivectomia.</p><p>Imobilização dentária temporária ou permanente</p><p>Raspagem, alisamento e polimento radicular.</p><p>Sepultamento radicular</p><p><strong><u>CIRURGIA:</u></strong></p><p>Alveoloplastia.</p><p>Biópsia. <sup>10</sup></p><p>Cirurgia de tórus palatino.</p><p>Correção de brida muscular.</p><p>Excisão de mucocele. </p><p>Excisão de rânula.</p><p>Exodontia de raiz residual (por elemento).</p><p>Frenectomia labial.</p><p>Frenectomia lingual.</p><p>Hemissecção com ou sem amputação radicular.</p><p>Reconstrução do sulco gengivo-labial.</p><p>Remoção dente retido (incluso ou impactado).</p><p>Sulcoplastia.</p><p><br></p><p class=\"ql-align-center\"><strong>COBERTURA ASSITENCIAL</strong></p><p class=\"ql-align-center\"><strong>COM COPARTICIPAÇÃO</strong></p><p class=\"ql-align-center\"><strong>CARÊNCIA 180 DIAS</strong></p><p class=\"ql-align-center\"><br></p><p><strong><u>RADIOLOGIA</u>:</strong></p><p>Panorâmica da mandíbula / maxila. <sup>11</sup></p><p><strong><u>PREVENÇÃO EM SAÚDE BUCAL<