p;&nbsp;&nbsp;&nbsp;</strong>Procedimento restaurador minimamente invasivo em dentes decíduos e permanentes;</p><p><strong>b.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</strong>Procedimento preventivo em fóssulas e fissuras de dentes decíduos e permanentes.</p><p>5. <strong>TRATAMENTO CONSERVADOR COM AMÁLGAMA, RESINA QUIMICAMENTE ATIVA OU IONÔMERO DE VIDRO</strong></p><p>6.<strong>CONTROLE OU EVIDENCIAÇÃO DE PLACA BACTERIANA / TECNICA DE ESCOVAÇÃO</strong></p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Até 14 anos de idade</p><p><br></p><p>7. <strong>APLICAÇÃO DE CARIOSTÁTICO </strong></p><p>&nbsp;&nbsp;Cobertura obrigatória como tratamento provisório em dentes decíduos, visando interromper a atividade da cárie, devendo ser seguido de um tratamento restaurador e associado a ações de promoção da saúde e prevenção de doenças, conforme indicação do cirurgião dentista assistente.</p><p>8. <strong>ADEQUAÇÃO DO MEIO BUCAL</strong></p><p>Cobertura obrigatória como tratamento preliminar ao tratamento restaurador, conforme indicação do cirurgião dentista assistente.</p><p><br></p><p>9.<strong>TRATAMENTO CONSERVADOR COM RESINA FOTOPOLIMERIZÁVEL</strong></p><p>10.<strong> BIÓPSIA DE BOCA</strong></p><p>Para a segmentação odontológica, a cobertura será obrigatória quando a extensão, localização e características da lesão &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;permitirem a realização do procedimento em ambiente ambulatorial, conforme indicação do cirurgião dentista assistente.</p><p>·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<strong>BIÓPSIA DE GLANDULA SALIVAR</strong></p><p>Para a segmentação odontológica, a cobertura será obrigatória quando a extensão, localização e características da lesão permitirem a realização do procedimento em ambiente ambulatorial, conforme indicação do cirurgião dentista assistente.</p><p>·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<strong>BIÓPSIA DE LÍNGUA </strong></p><p>Para a segmentação odontológica, a cobertura será obrigatória quando a extensão e características da lesão permitirem a realização do procedimento em ambiente ambulatorial, conforme indicação do cirurgião dentista assistente.</p><p>·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<strong>BIÓPSIA DE MANDÍBULA / MAXILA </strong></p><p>Para a segmentação odontológica, a cobertura será obrigatória quando a extensão, localização e característica da lesão permitirem a realização do procedimento em ambiente ambulatorial, conforme indicação do cirurgião dentista assistente.</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;11. <strong>PANORÂMICA DE MANDÍBULA/MAXILA</strong></p><p><strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;(ORTOPANTOMOGRAFIA)</strong></p><p>Cobertura obrigatória na segmentação odontológica como auxílio diagnóstico; pré e/ou pós procedimento cirúrgico odontológico.</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;12. <strong>CONDICIONAMENTO EM ODONTOLOGIA</strong></p><p>Cobertura mínima obrigatória de 3 (três) sessões/ ano para beneficiários com comportamento não cooperativo/de difícil manejo, conforme indicação do cirurgião dentista assistente.</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;13. <strong>REABILITAÇÃO COMO COROA DE ACETATO/AÇO OU POLICARBONATO</strong></p><p>Cobertura obrigatória quando preenchido pelo menos um dos seguintes critérios, conforme indicação do cirurgião dentista assistente:</p><p>a)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Dentes decíduos não passiveis de reconstrução por meio direto;</p><p>b)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Dentes permanentes em pacientes não cooperativos/de difícil manejo.</p><p><br></p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;14. <strong>EXÉRESE DE PEQUENOS CISTOS DE MANDÍBULA / MAXILA</strong></p><p>Para a segmentação odontológica, a cobertura será obrigatória quando a localização e características da lesão permitirem a realização do procedimento em ambiente ambulatorial, conforme indicação do cirurgião dentista assistente.</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;15. <strong>TRATAMENTO CIRÚRGICO DE FÍSTULA BUCO-NASAL OU BUCO-SINUSAIS</strong></p><p>Para a segmentação odontológica, a cobertura será obrigatória quando a extensão, localização e característica da lesão permitirem a realização do procedimento em ambiente ambulatorial, conforme indicação do cirurgião dentista assistente.</p><p><br></p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;16. <strong>TRATAMENTO CIRÚRGICO DE TUMORES BENIGNOS E HIPERPLASIAS DE TECIDO ÓSSEOS/ &nbsp;&nbsp;&nbsp;CARTILOGINOSOS NA MANDÍBULA/ MAXILA</strong></p><p>Para a segmentação odontológica, a cobertura será obrigatória quando a extensão, localização e característica da lesão permitirem a realização do procedimento em ambiente ambulatorial, conforme indicação do cirurgião dentista assistente.</p><p>&nbsp;17. <strong>TRATAMENTO CIRÚRGICO DE TUMORES BENIGNOS E HIPERPLASIAS DE TECIDOS MOLES DA &nbsp;&nbsp;REGIÃO BUCO- MAXILO-FACIAL</strong></p><p>Para segmentação odontológica, a cobertura será obrigatória quando a extensão, localização e características da lesão permitirem a realização do procedimento em ambiente ambulatorial, conforme a indicação do cirurgião dentista assistente.</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;18. <strong>TRATAMENTO CIRÚRGICO DE TUMORES BENIGNOS ODONTOGENICOS SEM RECONSTRUÇÃO</strong></p><p>&nbsp;&nbsp;Para a segmentação odontológica, a cobertura será obrigatória quando a extensão, localização e características da lesão&nbsp;&nbsp;&nbsp;&nbsp;permitirem a realização do procedimento em ambiente ambulatorial, conforme indicação do cirurgião dentista assistente.</p><p>&nbsp;&nbsp;&nbsp;19. <strong>COROA UNITARIA PROVISÓRIA COM OU SEM PINO/ PROVISÓRIO PARA PREPARO DE &nbsp;&nbsp;RESTAURAÇÃO METÁLICA FUNDIDA (RMF)</strong></p><p>Cobertura obrigatória como procedimento de caráter provisório, em dentes permanentes não passiveis de reconstrução por meio direto, conforme indicação do cirurgião dentista assistente.</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;20. &nbsp;<strong>REABILITAÇÃO COM COROA TOTAL DE CEROMERO UNITÁRIA - INCLUI A PEÇA PROTÉTICA</strong></p><p>Cobertura obrigatória em dentes permanentes anteriores (incisivos e caninos) não passíveis de reconstrução por meio &nbsp;&nbsp;direto, conforme indicação do cirurgião dentista assistente.</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;21. &nbsp;<strong>REABILITAÇÃO COM COROA TOTAL METÁLICA UNITÁRIA – INCLUI A PEÇA PROTÉTICA </strong></p><p>Cobertura obrigatória em dentes permanentes posteriores (pré-molares e molares) não passíveis de reconstrução por meio direto nem Restauração Metálica Fundida, conforme indicação do cirurgião dentista assistente.</p><p>&nbsp;&nbsp;&nbsp;22. &nbsp;<strong>REABILITAÇÃO COM NÚCLEO METÁLICO FUNDIDO/NÚCLEO PRÉ –FABRICADO-INCLUI A PEÇA PROTÉTICA</strong></p><p>Cobertura obrigatória em dentes permanentes com tratamento endodôntico prévio, conforme indicação do cirurgião dentista assistente.</p><p>&nbsp;&nbsp;&nbsp;23. &nbsp;<strong>REABILITAÇÃO COM RESTAURAÇÃO METÁLICA FUNDIDA (RMF) UNITÁRIA –INCLUI A PEÇA PROTÉTICA</strong></p><p>Cobertura obrigatória em dentes permanentes posteriores quando preenchido pelo menos um dos seguintes critérios, conforme indicação do cirurgião dentista assistente:</p><p>a)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Dentes com comprometimento de 3 (três) ou mais faces, não passiveis de reconstrução por meio direto;</p><p>b)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Dentes com comprometimento de cúspide funcional, independentemente do número de faces afetadas.</p><p class=\"ql-align-center\"><strong>ATOS NÃO COBERTOS PELO ROL DA ANS SERÃO COBRADOS PELA TABELA PRÓPRIA DA UNIODONTO JUIZ DE FORA</strong></p><p><br></p>',1,'https://s3.us-east-1.amazonaws.com/arquivoscomprodonto/fotos