INSERT INTO `providers` VALUES (1,'Uniodonto Poços de Caldas','03.494.031/0001-34','isis.souza@uniodontopocos.com.br','R. Tutóia','51','Jardim dos Estados',NULL,'Poços de Caldas','MG','37701-788','http://via.placeholder.com/500','(35) 3716-7222','<p>Há 18 anos atendendo ao mercado em Poços de Caldas, a Uniodonto tem o compromisso de oferecer assistência odontológica com qualidade e preços acessíveis, atuando pela constante redução nos custos do tratamento odontológico, para que mais pessoas tenham acesso aos consultórios. A grande característica do sistema é garantir uma cobertura efetivamente nacional. O usuário da cooperativa que estiver viajando ou trabalhando fora é atendido em qualquer cidade do país que possua um profissional cooperado, sem burocracia. Esta é a maior rede de atendimento odontológico do Brasil e do Mundo. A Uniodonto é uma das líderes deste segmento de mercado, seja pelo número de usuários ou pela diversidade dos planos que sempre oferece aos seus clientes.</p>','<p><span style=\"background-color: transparent; color: rgb(0, 0, 0);\">Quando vou receber minha carteirinha?</span></p><p class=\"ql-align-justify\"><span style=\"background-color: transparent;\">Pedimos 24h para que você tenha acesso ao cartão virtual  através do nosso aplicativo </span>\"Uniodonto Poços\"<span style=\"background-color: transparent;\">. Após este período, você poderá usufruir de todos os procedimentos e consultas da cobertura do plano contratado.</span></p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\"><strong style=\"background-color: transparent; color: rgb(0, 0, 0);\">Como acesso o aplicativo?</strong></p><p class=\"ql-align-justify\"><span style=\"background-color: transparent; color: rgb(0, 0, 0);\">Baixe o aplicativo \"Uniodonto Poços\" na Google Play ou App Store, faça seu login utilizando seu CPF e Data de nascimento. Nele você encontrará todas as informações sobre a cobertura do plano contratado, os dentistas disponíveis em sua região e número da carteirinha. </span></p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\"><strong style=\"background-color: transparent; color: rgb(0, 0, 0);\">Como marcar consultas?</strong></p><p class=\"ql-align-justify\"><span style=\"background-color: transparent; color: rgb(0, 0, 0);\">Procure pelo dentista de sua preferência e agende diretamente pelo telefone disponibilizado para consulta no aplicativo. </span></p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\"><strong style=\"background-color: transparent; color: rgb(0, 0, 0);\">Posso adicionar mais alguém no plano?</strong></p><p class=\"ql-align-justify\">Uma vez contratado, nossos planos são individuais. </p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\"><strong style=\"background-color: transparent; color: rgb(0, 0, 0);\">Como serão cobradas as próximas mensalidades? </strong></p><p class=\"ql-align-justify\"><span style=\"background-color: transparent; color: rgb(0, 0, 0);\">A partir do pagamento da primeira mensalidade, que já foi efetuada, o próximo pagamento acontecerá mensalmente no cartão utilizado. </span></p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\"><strong>No caso de cancelamento há alguma multa?</strong></p><p>Ocorrendo a rescisão antes do término do prazo inicial de vigência, o CONTRATANTE se sujeitará ao pagamento multa pecuniária equivalente a 20 % (vinte por cento) do valor das mensalidades que seriam devidas até o término do citado prazo.</p><p class=\"ql-align-justify\"><br></p><p><br></p><p><br></p><p><br></p><p><br></p>',NULL,'2021-04-30 13:07:46',NULL,'426.610/99-2','3','9e7eeada-1819-4e45-8c78-f3a88a473a09',NULL,NULL,1,NULL),(10,'Uniodonto São José dos Campos','73.162.760/0001-79','posvendas03@uniodontosjc.com.br','Pc. Presidente Kennedy','24','Centro',NULL,'São José dos Campos','SP','12245-730','http://via.placeholder.com/500','(12) 3202-6030','<p>Plano Uniodonto</p><p><br></p><p><strong><em>-&nbsp;Carência Zero em todos os procedimentos</em></strong></p><p><span style=\"color: rgb(51, 51, 51);\">A Uniodonto é a única rede que possui carência zero, para todos os planos em todas as especialidades odontológicas. </span></p><p><br></p><p><strong><em>- Atendimento 24h em todo o Brasil</em></strong></p><p>Para casos de urgência, você tem cobertura nacional para dos procedimentos de emergência.</p><p><br></p><p><strong><em>- Ampla rede de dentistas</em></strong></p><p><span style=\"color: rgb(0, 0, 0);\">A Uniodonto possui uma extensa rede de dentistas cooperados, prontos para atender você sempre que precisar!</span></p><p><br></p><p><strong><em>- Atendimento em todas as áreas odontológicas</em></strong></p><p><br></p><p><strong><em>- Aprovação online</em></strong></p><p>Faça sua&nbsp;consulta e aprove seu&nbsp;tratamento direto no consultório do dentista,&nbsp;simples, rápido e sem nenhuma burocracia.</p><p><br></p><p><strong><em>-&nbsp;Atos não cobertos </em></strong>(fora da cobertura contratual)</p><p>Para deixar o seu sorriso ainda mais bonito, qualquer outro tratamento que você quiser, a Uniodonto faz.</p><p><br></p><p>FAZ PRÓTESES.</p><p>FAZ IMPLANTES.</p><p>FAZ CLAREAMENTO.</p><p>FAZ TUDO ISSO E</p><p>MUITO MAIS.</p><p><br></p><p><strong><em>- Aplicativo Uniodonto SJC</em></strong></p><p>﻿O aplicativo Uniodonto SJC facilita a sua pesquisa dos dentistas cooperados que atendem o seu plano entre outros serviços da Uniodonto, na palma da sua mão!</p>','<p><span style=\"background-color: transparent;\">Quando vou receber minha carteirinha?</span></p><p class=\"ql-align-justify\"><span style=\"background-color: transparent;\">Pedimos 48h para que você tenha acesso ao cartão virtual  através do nosso</span> site \"https://www.uniodontosjc.com.br\"<span style=\"background-color: transparent;\">. Após este período, você poderá usufruir de todos os procedimentos e consultas da cobertura do plano contratado.</span></p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\"><span style=\"background-color: transparent;\">Como marcar consultas?</span></p><p class=\"ql-align-justify\"><span style=\"background-color: transparent;\">Procure pelo dentista de sua preferência e agende diretamente pelo telefone disponibilizado para consulta no aplicativo </span><span style=\"color: rgb(0, 0, 0);\"> \"Uniodonto SJC\" disponível na Google Play ou App Store, ou pelo site: \"</span>https://www.uniodontosjc.com.br/encontre-seu-dentista\"</p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\"><span style=\"background-color: transparent;\">Posso adicionar mais alguém no plano?</span></p><p class=\"ql-align-justify\">Uma vez contratado, nossos planos são individuais. </p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\"><span style=\"background-color: transparent;\">Como serão cobradas as próximas mensalidades? </span></p><p class=\"ql-align-justify\"><span style=\"background-color: transparent;\">A partir do pagamento da primeira mensalidade, que já foi efetuada, o próximo pagamento acontecerá mensalmente no cartão utilizado. </span></p><p><br></p>','2019-02-05 14:04:00','2021-03-05 17:11:49',NULL,'31.375-1','2','d7ac4109-5f40-4190-b56b-b4344876c091','ti@uniodontosjc.com.br','0f0064a7-324e-4ce3-b4ba-8429bd2528dbdc16c13a425fadd2073c7e7bc492407355ce-c5eb-4184-bac9-df0ded60160f',1,NULL),(11,'Uniodonto Santos','73.162.760/0001-78','posvendas03@uniodontosjc.com.br','Avenida Affonso Penna','30','Boqueirão','Conj. 01','Santos','SP','11020-002','http://via.placeholder.com/500','(12) 3202-6030','<p>Plano Uniodonto</p><p><br></p><p><strong>-&nbsp;Carência Zero em todos os procedimentos</strong></p><p>A Uniodonto é a única rede que possui carência zero, para todos os planos em todas as especialidades odontológicas.</p><p><br></p><p><strong>- Atendimento 24h em todo o Brasil</strong></p><p>Para casos de urgência, você tem cobertura nacional para dos procedimentos de emergência.</p><p><br></p><p><strong>- Ampla rede de dentistas</strong></p><p>A Uniodonto possui uma extensa rede de dentistas cooperados, prontos para atender você sempre que precisar!</p><p><br></p><p><strong>- Atendimento em todas as áreas odontológicas</strong></p><p>A Uniodonto possui uma extensa rede de dentistas cooperados especializados e certificados em constante atualização.</p>','<p>Obrigado por ter escolhido a Uniodonto. É uma satisfação tê-lo como nosso beneficiário.</p><p>O prazo para a conclusão do cadastro é de 48 horas após a confirmação do pagamento pela sua operadora de cartão de crédito.</p><p>Assim que seu contrato for cadastrado, você receberá um e-mail com o código da carteirinha de cada beneficiário.</p>','2019-02-05 14:04:00','2020-10-02 00:53:27',NULL,'31.375-1','2','d7ac4109-5f40-4190-b56b-b4344876c091',NULL,NULL,1,NULL),(12,'Uniodonto Catanduva','00.855.599/0001-45','cadastro@uniodontocatanduva.com.br','Praça Nove de Julho','141','Centro',NULL,'Catanduva','SP','15800-225','https://s3..amazonaws.com//fotos_operadoras/logo uniodonto 2020.jpg','(17) 3523-2516','<p>Há 25 anos a Uniodonto de Catanduva está atendendo ao mercado de nossa cidade e região. Nossa cooperativa tem o compromisso de oferecer uma assistência odontológica com qualidade, focada nos princípios cooperativista e regulamentada pela Agência Nacional de Saúde Suplementar;</p><p><br></p><p>Oferecemos um atendimento personalizado, com hora marcada e no consultório do dentista cooperado;</p><p><br></p><p>Garantia dos tratamentos odontológicos por até 24 meses;</p><p><br></p><p>Planos sem limites de utilização;</p><p><br></p><p>Livre escolha do cirurgião – dentista cooperado de sua preferência, sendo aproximadamente 90 profissionais em Catanduva e região;</p><p><br></p><p>Dentistas cooperados em todas as especialidades;</p><p><br></p><p>Emergência pelo Sistema Uniodonto em todo o Brasil;</p><p><br></p><p><strong>PLANO ORTO VIP</strong></p><p>O plano Orto Vip oferece uma comodidade onde o beneficiário incluso terá o direito de usar os procedimentos que possuem cobertura pelo Rol de Procedimento da ANS além dos procedimentos de ortodontia descritos na proposta com 50% de desconto, documentação ortodôntica sem custo.</p><p><br></p><p><strong>PLANO UNIPROGRESSIVO</strong></p><p>O plano Uniprogressivo é um plano voltado para tratamentos odontológicos com um diferencial em custo de co-participação na cobertura do Rol da ANS, onde o cliente terá descontos progressivos na cobertura com o passar do tempo. No 1º ano ele terá 50% de desconto, no 2º ano ele terá 75% de desconto e depois de 24 meses ele terá 100% de desconto na cobertura do Rol exigido pela ANS (exceto procedimentos de próteses e demais atualizações do Rol que se mantém com 50% de desconto).</p>','<p>Documentos necessários para o fechamento do seu contrato:</p><p>• RG, CPF e Cartão do SUS do titular e dependentes.</p><p>• Comprovante de endereço.</p><p>O contrato será efetuado mediante o pagamento da</p><p>primeira mensalidade.</p><p><br></p><p>PRAZO DE CADASTRO APÓS A COMPROVAÇÃO DA OPERADORA DE CARTÃO DE CRÉDITO: 48H</p><p><br></p><p>Quem pode aderir os plano?</p><p>Dependentes legais</p><p>O cônjuge, o convivente, os filhos, o enteado, o</p><p>menor sob a guarda e o menor tutelado, os netos e</p><p>bisnetos, os irmãos, os pais, avós e bisavós.</p><p><br></p><p>Agregados</p><p>Os tios e os sobrinhos, os sogros, os genros e as</p><p>noras, os cunhados, os padrastos e madrastas.</p><p><br></p><p>Importante: Menores entre 16 anos a 18 anos incompletos assinam junto com o responsável legal.</p><p><br></p><p>O contrato tem&nbsp;reajuste anual previsto em contrato, na data de aniversário.</p>','2020-06-19 15:04:00','2020-10-02 14:49:03',NULL,'35.468-6','5','dc87ee9b-398a-4554-9c7b-c23322929a22',NULL,NULL,0,NULL),(13,'Uniodonto Natal','08.237.810/0001-78','cadastro2@uniodontorn.com.br','Rua Açu','665','Tirol',NULL,'Natal','RN','59020-110','https://s3.us-east-1.amazonaws.com/arquivoscomprodonto/fotos_operadoras/RIO GRANDE DO NORTE (1).png','(84) 4009-4664','<p><strong>Plano Odonto Master Uni </strong></p><ul><li><span style=\"color: rgb(75, 75, 77);\">Cobertura do rol de procedimentos solicitados pela ANS – Agência Nacional de Saúde, incluindo:</span></li><li><span style=\"color: rgb(75, 75, 77);\">Urgência odontológica 24 horas (na sede da cooperativa).</span></li><li><span style=\"color: rgb(75, 75, 77);\">Diagnóstico/Consultas.</span></li><li><span style=\"color: rgb(75, 75, 77);\">Radiologia.</span></li><li><span style=\"color: rgb(75, 75, 77);\">Tratamentos preventivos em saúde bucal.</span></li><li><span style=\"color: rgb(75, 75, 77);\">Dentística (restauração).</span></li><li><span style=\"color: rgb(75, 75, 77);\">Periodontia (gengivas).</span></li><li><span style=\"color: rgb(75, 75, 77);\">Endodontia (canal).</span></li><li><span style=\"color: rgb(75, 75, 77);\">Cirurgias.</span></li><li><span style=\"color: rgb(75, 75, 77);\">Prótese*.</span></li><li><span style=\"color: rgb(75, 75, 77);\">Odontopediatria.</span></li><li><span style=\"color: rgb(75, 75, 77);\">Exodontia.</span></li></ul><p><br></p><p><strong>Vantagens do plano</strong></p><ul><li><span style=\"color: rgb(75, 75, 77);\">Desconto progressivo para quantidade de dependentes.</span></li><li><span style=\"color: rgb(75, 75, 77);\">Promoção especial para clientes Unimed e Servidores Públicos.</span></li><li><span style=\"color: rgb(75, 75, 77);\">Atendimento em ampla rede credenciada.</span></li><li><span style=\"color: rgb(75, 75, 77);\">Dedução do valor das mensalidades, para os que declaram Imposto de Renda de Pessoa Física.</span></li><li><span style=\"color: rgb(75, 75, 77);\">Profissionais especializados em varias áreas da Odontologia.</span></li><li><span style=\"color: rgb(75, 75, 77);\">Atendimento personalizado com dia e hora marcada, em consultórios particulares.</span></li><li><span style=\"color: rgb(75, 75, 77);\">Cobertura para dependentes/agregados (inclusive: mãe/pai, irmão/irmã, netos, sobrinhos, avós, sogros).</span></li><li><span style=\"color: rgb(75, 75, 77);\">Consultórios distribuídos em diversos bairros de Natal, área metropolitana e nos principais municípios do interior norte rio-grandense.</span></li><li><span style=\"color: rgb(75, 75, 77);\">Maior sistema odontológico em abrangência no país, com atendimento em qualquer cidade que tenha um dentista Uniodonto, pelo sistema de Intercâmbio.</span></li><li><span style=\"color: rgb(75, 75, 77);\">Exclusiva clínica própria para Urgências Odontológicas, funcionando 24 horas por dia, 7 dias por semana, inclusive feriados.</span></li><li><span style=\"color: rgb(75, 75, 77);\">Livre escolha do dentista associado em todas as especialidades.</span></li></ul><p><br></p><p><br></p><p><strong>Plano Uniortondontia</strong></p><ul><li>Cobertura do rol de procedimentos solicitados pela ANS – Agência Nacional de Saúde, incluindo:</li><li>Urgência odontológica 24 horas (na sede da cooperativa).</li><li>Diagnóstico/Consultas.</li><li>Radiologia.</li><li>Tratamentos preventivos em saúde bucal.</li><li>Dentística (restauração).</li><li>Periodontia (gengivas).</li><li>Endodontia (canal).</li><li>Cirurgias.</li><li>Prótese*.</li><li>Odontopediatria.</li><li>Ortodontia.</li><li>Exodontia.</li></ul><p><br></p><p><strong>Vantagens do plano</strong></p><ul><li>Atendimento em ampla rede credenciada.</li><li>Dedução do valor das mensalidades, para os que declaram Imposto de Renda de Pessoa Física.</li><li>Profissionais especializados em várias áreas da Odontologia.</li><li>Atendimento personalizado com dia e hora marcada, em consultórios particulares.</li><li>Cobertura para dependentes/agregados (inclusive: mãe/pai, irmão/irmã, netos, sobrinhos, avós, sogros).</li><li>Consultórios distribuídos em diversos bairros de Natal, área metropolitana e nos principais municípios do interior norte rio-grandense.</li><li>Maior sistema odontológico em abrangência no país, com atendimento em qualquer cidade que tenha um dentista Uniodonto, pelo sistema de Intercâmbio.</li><li>Exclusiva clínica própria para Urgências Odontológicas, funcionando 24 horas por dia, 7 dias por semana, inclusive feriados.</li><li>Livre escolha do dentista associado em todas as especialidades.</li></ul><p><br></p><p><em><u>*Conforme Rol da ANS</u></em></p>','<p>Documentos necessários para o fechamento do seu contrato:</p><p>• RG, CPF e Cartão do SUS do titular e dependentes.</p><p>• Comprovante de endereço.</p><p>O contrato será efetuado mediante o pagamento da</p><p>primeira mensalidade.</p><p><br></p><p>PRAZO DE CADASTRO APÓS A COMPROVAÇÃO DA OPERADORA DE CARTÃO DE CRÉDITO: 48H</p><p><br></p><p>Quem pode aderir os plano?</p><p>Dependentes legais</p><p>O cônjuge, o convivente, os filhos, o enteado, o</p><p>menor sob a guarda e o menor tutelado, os netos e</p><p>bisnetos, os irmãos, os pais, avós e bisavós.</p><p><br></p><p>Agregados</p><p>Os tios e os sobrinhos, os sogros, os genros e as</p><p>noras, os cunhados, os padrastos e madrastas.</p><p><br></p><p>Importante: Menores entre 16 anos a 18 anos incompletos assinam junto com o responsável legal.</p><p><br></p><p>O contrato tem&nbsp;reajuste anual previsto em contrato, na data de aniversário.</p>','2020-06-19 15:04:00','2021-02-08 18:40:02',NULL,'34.531-8','6','a2e0b4d9-44ce-4f04-8a5e-7b4f5b569f5b',NULL,NULL,0,NULL),(14,'Uniodonto Piracicaba','52.204.526/0001-97','publicidade@uniodontopiracicaba.com.br','R. Alferes José Caetano','1352','Centro',NULL,'Piracicaba','SP','13400-123','https://s3.us-east-1.amazonaws.com/arquivoscomprodonto/fotos_operadoras/logopira.jpg','(19) 3401-1770','<p><span style=\"color: rgb(52, 52, 52);\">Plano Odontológico Uniodonto</span></p><p><span style=\"color: rgb(52, 52, 52);\">Ideal para quem quer realizar desde os procedimentos mais simples até os mais complexos, o Plano PPR50 é completo e possui um ótimo custo-benefício. </span></p><p><br></p><p><span style=\"color: rgb(52, 52, 52);\">Através de uma pequena mensalidade, você tem cobertura de tratamentos em todas as áreas da odontologia.</span></p><p><br></p><p><span style=\"color: rgb(52, 52, 52);\">Este plano tem cobertura nas seguintes especialidades:</span></p><p><span style=\"color: rgb(52, 52, 52);\">• CONSULTA</span></p><p><span style=\"color: rgb(52, 52, 52);\"> • TRATAMENTO DE URGÊNCIA</span></p><p><span style=\"color: rgb(52, 52, 52);\">• ENDODONTIA (CANAL)</span></p><p><span style=\"color: rgb(52, 52, 52);\">• EXTRAÇÃO</span></p><p><span style=\"color: rgb(52, 52, 52);\">• CIRURGIAS (EM CONSULTÓRIO)</span></p><p><span style=\"color: rgb(52, 52, 52);\">•&nbsp;DENTÍSTICA RESTAURADORA (OBTURAÇÕES)</span></p><p><span style=\"color: rgb(52, 52, 52);\">• PROFILAXIA (LIMPEZA)</span></p><p><span style=\"color: rgb(52, 52, 52);\">Confira a cobertura completa em detalhes do plano.</span></p><p><span style=\"color: rgb(52, 52, 52);\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></p><p><span style=\"color: rgb(52, 52, 52);\">Este convênio oferece desconto nos seguintes atos:</span></p><p><span style=\"color: rgb(52, 52, 52);\">• TÉCNICAS DE HIGIENE BUCAL</span></p><p><span style=\"color: rgb(52, 52, 52);\">• APLICAÇÃO DE FLÚOR E SELANTE</span></p><p><span style=\"color: rgb(52, 52, 52);\">• RASPAGEM DE TÁRTARO</span></p><p><span style=\"color: rgb(52, 52, 52);\">• RADIOGRAFIA DE DIAGNÓSTICO</span></p><p><span style=\"color: rgb(52, 52, 52);\">• PRÓTESE E CONDICIONAMENTO</span></p><p><span style=\"color: rgb(52, 52, 52);\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></p><p><span style=\"color: rgb(52, 52, 52);\">-&nbsp;Atos não cobertos (fora da cobertura contratual)</span></p><p><span style=\"color: rgb(52, 52, 52);\">Para deixar o seu sorriso ainda mais bonito, qualquer outro tratamento que você quiser, a Uniodonto faz.</span></p><p><br></p><p><span style=\"color: rgb(52, 52, 52);\">FAZ PRÓTESES.</span></p><p><span style=\"color: rgb(52, 52, 52);\">FAZ IMPLANTES.</span></p><p><span style=\"color: rgb(52, 52, 52);\">FAZ CLAREAMENTO.</span></p><p><span style=\"color: rgb(52, 52, 52);\">FAZ TUDO ISSO E</span></p><p><span style=\"color: rgb(52, 52, 52);\">MUITO MAIS.</span></p><p><br></p><p><span style=\"color: rgb(52, 52, 52);\">Conheça outros benefícios do plano Uniodonto:</span></p><p><br></p><p><span style=\"color: rgb(52, 52, 52);\">- A maior rede de dentistas</span><span style=\"color: black;\"> em Piracicaba e região. </span></p><p><span style=\"color: black;\">São mais de 350 dentistas cooperados na região e </span><span style=\"color: rgb(52, 52, 52);\">mais de 22.000 dentistas à sua disposição, atendendo em mais de 2.000 cidades brasileiras, cobrindo todo o território nacional</span><span style=\"color: black;\">, prontos para atender você sempre que precisar!</span></p><p><br></p><p><span style=\"color: black;\">- Atendimento com hora marcada, no consultório do dentista de sua escolha</span></p><p><br></p><p><span style=\"color: black;\">- Atendimento de todas as especialidades da odontologia</span></p><p><br></p><p><span style=\"color: rgb(52, 52, 52);\">- Aprovação online</span></p><p><span style=\"color: rgb(52, 52, 52);\">Faça sua&nbsp;consulta e aprove seu&nbsp;tratamento direto no consultório do dentista,&nbsp;simples, rápido e sem nenhuma burocracia.</span></p><p><br></p><p><span style=\"color: rgb(52, 52, 52);\">- Atendimento 24h em todo o Brasil</span></p><p><span style=\"color: rgb(52, 52, 52);\">Para casos de urgência, você tem cobertura nacional para os procedimentos de emergência.</span></p><p><span style=\"color: rgb(52, 52, 52);\">Em Piracicaba, você pode contar com atendimento 24h na Santa Casa de Piracicaba.</span></p><p><br></p><p><span style=\"color: rgb(52, 52, 52);\">- Aplicativo Uniodonto Piracicaba</span></p><p><span style=\"color: rgb(52, 52, 52);\">﻿O aplicativo Uniodonto Piracicaba facilita a sua pesquisa dos dentistas cooperados que atendem o seu plano, além da carteirinha virtual Uniodonto, na palma da sua mão!</span></p>','<p>Documentos necessários para o fechamento do seu contrato:</p><p>• RG, CPF e Cartão do SUS do titular e dependentes.</p><p>• Comprovante de endereço.</p><p>O contrato será efetuado mediante o pagamento da</p><p>primeira mensalidade.</p><p><br></p><p>PRAZO DE CADASTRO APÓS A COMPROVAÇÃO DA OPERADORA DE CARTÃO DE CRÉDITO: 48H</p><p><br></p><p>Quem pode aderir os plano?</p><p>Dependentes legais</p><p>O cônjuge, o convivente, os filhos, o enteado, o</p><p>menor sob a guarda e o menor tutelado, os netos e</p><p>bisnetos, os irmãos, os pais, avós e bisavós.</p><p><br></p><p>Agregados</p><p>Os tios e os sobrinhos, os sogros, os genros e as</p><p>noras, os cunhados, os padrastos e madrastas.</p><p><br></p><p>Importante: Menores entre 16 anos a 18 anos incompletos assinam junto com o responsável legal.</p><p><br></p><p>O contrato tem&nbsp;reajuste anual previsto em contrato, na data de aniversário.</p>','2020-06-19 15:04:00','2020-11-26 15:55:02',NULL,'34.600-4','7','dda80845-2083-4984-9b00-72aeec38c192',NULL,NULL,0,NULL),(15,'Uniodonto Vale Histórico','02.149.799/0001-08','cadastro@uniodontovalehistorico.com.br','Praça Dr. Gama Rodrigues','365','Bairro da Cruz',NULL,'Lorena','SP','12606-080','https://s3.us-east-1.amazonaws.com/arquivoscomprodonto/fotos_operadoras/LOGO UNIODONTO.png','(12) 3153-2900','<p>A Uniodonto é uma cooperativa odontológica com a maior rede de atendimento odontológico do Brasil.</p><p><br></p><p>Instalada a singular Uniodonto Vale Histórico em 1972 na cidade de Lorena, e com escritórios na cidade de Cruzeiro e Guaratinguetá, tendo como parceiras empresas Nacionais, multinacionais e pessoas físicas.</p><p>Em nossos municípios contamos com cerca de 127 dentistas e mais de 20 mil beneficiários, por isso somos referência em atendimento odontológico.</p><p><br></p><p>No Brasil temos mais de 22 mil cirurgiões dentistas garantindo o seu tratamento.</p><p><br></p><p>Confira abaixo o melhor plano para lhe atender</p><p><br></p><p><strong>PLANO AZUL</strong></p><ul><li>Plano ideal para você e sua família!&nbsp;</li><li>Com uma cobertura extensa inclusa no Roll de procedimentos da ANS;</li><li>Livre escolha do dentista - Você é atendido em consultório particular;</li><li>Atendimento de Urgência em todo país;</li><li>Dentistas especializados - Plano recorrente, valores descontados mensalmente no seu cartão!</li></ul><p><br></p><p><strong>PLANO STANDER</strong></p><ul><li>Plano ideal para crianças de 0 a 12 anos;</li><li>Atendimento de Urgência em todo país - Plano recorrente, valores descontados mensalmente no seu cartão;</li><li>Dentistas especializados em odontopediatria e tratamento de canal em dentes decíduo (leite);</li><li>Livre escolha do dentista - Você é atendido em consultório particular;</li></ul>','<p>Documentos necessários para o fechamento do seu contrato:</p><p>• RG, CPF e Cartão do SUS do titular e dependentes.</p><p>• Comprovante de endereço.</p><p>O contrato será efetuado mediante o pagamento da</p><p>primeira mensalidade.</p><p><br></p><p>PRAZO DE CADASTRO APÓS A COMPROVAÇÃO DA OPERADORA DE CARTÃO DE CRÉDITO: 48H</p><p><br></p><p>Quem pode aderir os plano?</p><p>Dependentes legais</p><p>O cônjuge, o convivente, os filhos, o enteado, o</p><p>menor sob a guarda e o menor tutelado, os netos e</p><p>bisnetos, os irmãos, os pais, avós e bisavós.</p><p><br></p><p>Agregados</p><p>Os tios e os sobrinhos, os sogros, os genros e as</p><p>noras, os cunhados, os padrastos e madrastas.</p><p><br></p><p>Importante: Menores entre 16 anos a 18 anos incompletos assinam junto com o responsável legal.</p><p><br></p><p>O contrato tem&nbsp;reajuste anual previsto em contrato, na data de aniversário.</p>','2020-06-19 15:04:00','2020-11-30 19:56:17',NULL,'38.265-5','8','53889a9f-135a-4747-a4bf-78a2c0d6c97b',NULL,NULL,0,NULL),(16,'Uniodonto Juiz de Fora','01.290.793/0001-93','uniodonto@unodontojf.com.br','R. Oscar Vidal','373','Centro',NULL,'Juiz de Fora','MG','36016-290','https://s3.us-east-1.amazonaws.com/arquivoscomprodonto/fotos_operadoras/´wallpaper 25 anos.png','(32) 3214-5577','<p>Há 24 anos a Uniodonto Juiz de Fora está atendendo ao mercado de nossa cidade e região. A Uniodonto Juiz de Fora busca prover as mais modernas técnicas de tratamento odontológico, fornecendo serviços de excelência em saúde suplementar, focada nos princípios cooperativista e regulamentada pela Agência Nacional de Saúde Suplementar;</p><p><br></p><p>Oferecemos um atendimento personalizado, com hora marcada e no consultório do dentista cooperado;</p><p><br></p><p>Planos sem limites de utilização;</p><p><br></p><p>Livre escolha do cirurgião – dentista cooperado de sua preferência, sendo mais de 150 prestadores em Juiz de Fora e região;</p><p><br></p><p>Mais de 22 mil profissionais em todo Brasil;</p><p><br></p><p>Dentistas cooperados em todas as especialidades;</p><p><br></p><p>Emergência pelo Sistema Uniodonto em todo o Brasil;</p><p><br></p><p>Plantão sobreaviso 24 horas;</p><p><br></p><p>Clube de vantagens para beneficiários locais com descontos no comércio e em serviços;</p><p><br></p><p>Seguimos todos os protocolos de segurança;</p><p><br></p><p>Tabela diferenciada para Atos Não Cobertos.</p><p><br></p><p><br></p><p><br></p>','<p>Documentos necessários para o fechamento do seu contrato:</p><p>• RG, CPF e Cartão do SUS do titular e dependentes.</p><p>• Comprovante de endereço.</p><p>O contrato será efetuado mediante o pagamento da</p><p>primeira mensalidade.</p><p><br></p><p>PRAZO DE CADASTRO APÓS A COMPROVAÇÃO DA OPERADORA DE CARTÃO DE CRÉDITO: 48H</p><p><br></p><p>Quem pode aderir os plano?</p><p>Dependentes legais</p><p>O cônjuge, o convivente, os filhos, o enteado, o</p><p>menor sob a guarda e o menor tutelado, os netos e</p><p>bisnetos, os irmãos, os pais, avós e bisavós.</p><p><br></p><p>Agregados</p><p>Os tios e os sobrinhos, os sogros, os genros e as</p><p>noras, os cunhados, os padrastos e madrastas.</p><p><br></p><p>Importante: Menores entre 16 anos a 18 anos incompletos assinam junto com o responsável legal.</p><p><br></p><p>O contrato tem&nbsp;reajuste anual previsto em contrato, na data de aniversário.</p>','2020-06-19 15:04:00','2021-05-14 14:00:06',NULL,'32.744-1','9','1584c49c-cb12-460f-a75d-46d76c6978e6',NULL,NULL,0,NULL),(17,'Uniodonto Passos Cooperativa Odontológica','02.768.410/0001-02','gerencia@uniodontopassos.com.br','Av. Arouca','717','Centro',NULL,'Passos','MG','37900-152','http://via.placeholder.com/500','(35) 3521-1370','<p><span style=\"color: rgb(52, 52, 52);\">Plano Uniodonto - Plano Individual Plus</span></p><p><span style=\"color: rgb(52, 52, 52);\">Ideal para quem quer realizar desde os procedimentos mais simples até os mais complexos, o Plano Individual Plus é completo e possui um ótimo custo-benefício. Ele cobre tratamentos em todas as áreas odontológicas de acordo com o rol e cobertura.</span></p><p><span style=\"color: rgb(52, 52, 52);\">&nbsp;</span></p><p><span style=\"color: rgb(52, 52, 52);\">- Aprovação online</span></p><p><span style=\"color: rgb(52, 52, 52);\">Faça sua&nbsp;consulta e aprove seu&nbsp;tratamento direto no consultório do dentista,&nbsp;simples, rápido e sem nenhuma burocracia.</span></p><p><span style=\"color: rgb(52, 52, 52);\">&nbsp;</span></p><p><span style=\"color: rgb(52, 52, 52);\">- Atendimento em todo o Brasil</span></p><p><span style=\"color: rgb(52, 52, 52);\">Para casos de urgência, você tem cobertura nacional para dos procedimentos de emergência de acordo com o rol de cobertura.</span></p><p><span style=\"color: rgb(52, 52, 52);\">&nbsp;</span></p><p><span style=\"color: rgb(52, 52, 52);\">-&nbsp;Atos NÃO cobertos (fora da cobertura contratual)</span></p><p><span style=\"color: rgb(52, 52, 52);\">Para deixar o seu sorriso ainda mais bonito, qualquer outro tratamento que você quiser, a Uniodonto faz.</span></p><p><span style=\"color: rgb(52, 52, 52);\">FAZ PRÓTESES.</span></p><p><span style=\"color: rgb(52, 52, 52);\">FAZ IMPLANTES.</span></p><p><span style=\"color: rgb(52, 52, 52);\">FAZ CLAREAMENTO.</span></p><p><br></p>','<p>Documentos necessários para o fechamento do seu cont