CREATE TABLE `subscriptions` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `plan_id` int(10) unsigned NOT NULL,
  `subscriber_id` int(10) unsigned NOT NULL,
  `status` enum('pending','active','suspended','expired','overdue','canceled','Pago','error') COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `best_invoice_date` int(10) unsigned DEFAULT NULL,
  `custom_price` int(10) unsigned DEFAULT NULL,
  `plans_description` varchar(191) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `uuid` varchar(191) COLLATE utf8mb4_unicode_ci NOT NULL,
  `protocolo` varchar(191) COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '0',
  `situacao` varchar(1) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `serviceTaxAmount` int(10) unsigned DEFAULT NULL,
  `boleto` text COLLATE utf8mb4_unicode_ci,
  `recurrent_payment_uuid` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `subscriptions_uuid_unique` (`uuid`),
  KEY `subscriptions_plan_id_foreign` (`plan_id`),
  KEY `subscriptions_subscriber_id_foreign` (`subscriber_id`),
  CONSTRAINT `subscriptions_plan_id_foreign` FOREIGN KEY (`plan_id`) REFERENCES `plans` (`id`),
  CONSTRAINT `subscriptions_subscriber_id_foreign` FOREIGN KEY (`subscriber_id`) REFERENCES `subscribers` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=1790 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;
